INSERT INTO `DoubanJson` VALUES ('ff8081813f14477c013f14481e320000','计算机组成原理','唐朔飞','','2008-1','高等教育','43.00元','由唐朔飞编著的《计算机组成原理》是普通高等教育“十一五”国家级规划教材。本书第1版被列为“面向21世纪课程教材”，是教育部高等学校计算机科学与技术教学指导委员会组织编写的“体系结构一组成原理一微机技术”系列教材之一，是2005年国家精品课程主讲教材，于2002年获普通高等学校优秀教材二等奖。    为了紧跟国际上计算机技术的新发展，《计算机组成原理》对第1版各章节的内容进行了补充和修改，并增加了例题分析，以加深对各知识点的理解和掌握。本书通过对一台实际计算机的剖析，使读者更深入地理解总线是如何将计算机各大部件互连成整机的。    全书共分为4篇，第1篇（第l、2章）介绍计算机的基本组成、发展及应用；第2篇（第3～5章）介绍系统总线、存储器（包括主存储器、高速缓冲存储器和辅助存储器）和输人输出系统；第3篇（第6～8章）介绍CPU的特性、结构和功能，包括计算机的算术逻辑单元、指令系统、指令流水、RISC技术及中断系统；第4篇（第9、10章）介绍控制单元的功能和设计，包括时序系统以及采用组合逻辑和微程序设计控制单元的设计思想与实现措施。每章后均附有思考题与习题。    本书概念清楚，通俗易懂，书中举例力求与当代计算机技术相结合，可作为高等学校计算机专业教材，也可作为其他科技人员的参考书。','http://book.douban.com/subject/2994636/','7040223902','http://img3.douban.com/spic/s4411273.jpg','http://img3.douban.com/mpic/s4411273.jpg','http://img3.douban.com/lpic/s4411273.jpg','http://api.douban.com/v2/book/2994636','ff8081813cfaad48013cfaadc9a50206'),('ff8081813f14477c013f14481e3f0001','计算机组成原理','唐朔飞','','2000-1','高等教育出版社','26.00元','《计算机组成原理》主要讲述了计算机的基本组成、发展和应用；总线、存储器和I/O系统；CPU的特性、结构和功能；控制单元的功能和设计思想。','http://book.douban.com/subject/1239582/','7040079275','http://img4.douban.com/spic/s1502278.jpg','http://img4.douban.com/mpic/s1502278.jpg','http://img4.douban.com/lpic/s1502278.jpg','http://api.douban.com/v2/book/1239582','ff8081813cfaad48013cfaadc9a50206'),('ff8081813f14477c013f14481e3f0002','计算机组成原理','白中英主编','','2008-1','科学','39.00元','《计算机组成原理》(第4版·立体化教材)讲授计算机单处理机系统的组成和工作原理。内容分12章：(1)计算机系统概论，(2)运算方法和运算器，(3)内部存储器，(4)指令系统，(5)中央处理机，(6)总线系统，(7)外围设备．(8)输入输出系统，(9)操作系统支持，(10)安腾高性能处理机体系结构，(11)教学实验设计，(12)课程综合设计。《计算机组成原理》(第4版·立体化教材)是作者对“计算机组成原理”课程体系、教学内容、教学方法、教学手段进行综合改革的具体成果。','http://book.douban.com/subject/3029610/','7030208242','http://img3.douban.com/spic/s25000564.jpg','http://img3.douban.com/mpic/s25000564.jpg','http://img3.douban.com/lpic/s25000564.jpg','http://api.douban.com/v2/book/3029610','ff8081813cfaad48013cfaadc9a50206'),('ff8081813f14477c013f14481e3f0003','计算机组成原理','白中英','','1994-1','科学出版社','28.0','本书是在国家级优秀教材《计算机组成原理教程》一书基础上修订的新版教材。内容分如下九章:计算机系统概论;运算方法和运算器;存储系统;指令系统;中央处理器;系统总线;外围设备;输入输出系统;实验与课程设计。\n    本书内容安排与中国计算机学会教育委员会、全国高等学校计算机教育研究会联合推荐的《计算机学科教学计划1993》相一致。\n    本书内容全面，概念清楚，系统性强，注重实践环节与能力培养，','http://book.douban.com/subject/1554354/','7030041410','http://img3.douban.com/spic/s2957402.jpg','http://img3.douban.com/mpic/s2957402.jpg','http://img3.douban.com/lpic/s2957402.jpg','http://api.douban.com/v2/book/1554354','ff8081813cfaad48013cfaadc9a50206'),('ff8081813f14477c013f14481e3f0004','计算机组成原理','白中英','','2001-1','科学出版社','33.00元','《计算机组成原理(网络版)》介绍计算机单处理机系统的组成和工作原理。内容包括：计算机系统概论；运算方法和运算器；存储系统；指令系统；中央处理器；总线系统；外围设备；输入输出系统。《计算机组成原理(网络版)》是作者对“计算机组成原理”的课程体系、教学内容。','http://book.douban.com/subject/1244896/','703010370X','http://img3.douban.com/spic/s9078293.jpg','http://img3.douban.com/mpic/s9078293.jpg','http://img3.douban.com/lpic/s9078293.jpg','http://api.douban.com/v2/book/1244896','ff8081813cfaad48013cfaadc9a50206'),('ff8081813f14477c013f14481e400005','计算机组成原理','','','2011-2','','38.00元','《计算机组成原理》主要介绍计算机单机系统的组成原理及内部工作机制，包括计算机各大部件的工作原理、设计方法、逻辑实现及互连构成计算机整机的技术。《计算机组成原理》共分9章，内容包括计算机系统概论、计算机中数据信息的表示方法、运算方法与运算器设计、存储系统、指令系统、控制器的工作原理与设计方法、流水线的基本概念、系统总线技术、输入输出设备及其组织结构和工作原理。\n《计算机组成原理》综合了编者多年的教学经验，并借鉴吸收了国内外经典教材的优点。在内容选取上，既重点论述了经典内容，又尽可能与国际先进教材的内容接轨，并选取一些反映计算机系统新发展的部分知识。内容充实、思路清晰、概念明确、重点突出、通俗易懂，并附有大量的例题、习题和课外实践内容。\n《计算机组成原理》可作为高等学校计算机及相关专业计算机组成原理课程的教材，也可作为有关专业研究生或计算机工程技术人员的参考书。','http://book.douban.com/subject/6014550/','7302240892','http://img3.douban.com/spic/s22791396.jpg','http://img3.douban.com/mpic/s22791396.jpg','http://img3.douban.com/lpic/s22791396.jpg','http://api.douban.com/v2/book/6014550','ff8081813cfaad48013cfaadc9a50206'),('ff8081813f14477c013f14481f170006','计算机算法设计与分析','王晓东','','2007-5','电子工业','29.50元','《计算机算法设计与分析(第3版)》为普通高等教育“十一五”国家级规划教材，是计算机专业核心课程“算法设计与分析”教材。全书以算法设计策略为知识单元，系统介绍计算机算法的设计方法与分析技巧。主要内容包括：算法概述、递归与分治策略、动态规划、贪心算法、回溯法、分支限界法、随机化算法、线性规划与网络流、NP完全性理论与近似算法等。书中既涉及经典与实用算法及实例分析，又包括算法热点领域追踪。\n为突出教材的可读性和可用性，章首增加了学习要点提示；章末配有难易适度的习题，分为算法分析题和算法实现题两部分；配套出版了《算法设计与实验题解》；并免费提供电子课件和教学网站服务。','http://book.douban.com/subject/2147362/','7121042789','http://img3.douban.com/spic/s23132370.jpg','http://img3.douban.com/mpic/s23132370.jpg','http://img3.douban.com/lpic/s23132370.jpg','http://api.douban.com/v2/book/2147362','ff8081813cfaad48013cfaadc99b01cd'),('ff8081813f14477c013f14481f180007','计算机算法的设计与分析','Alfred V.Aho (阿霍)/John E.Hopcroft (霍普克劳夫特)/Jeffrey D.Ullman (乌尔曼)','','2007-7-1','机械工业','49.00元','本书是一部设计与分析领域的经典著作，着重介绍了计算机算法设计领域的基本原则和根本原理。书中深入分析了一些计算机模型上的算法，介绍了一些和设计有效算法有关的数据结构和编程技术，为读者提供了有关递归方法、分治方法和动态规划方面的详细实例和实际应用，并致力于更有效算法的设计和开发。同时，对NP完全等问题能否有效求解进行了分析，并探索了应用启发式算法解决问题的途径。另外，本书还提供了大量富有指导意义的习题。\n本书可以作为高等院校计算机算法设计与分析课程的本科生或研究生教材，也可以作为计算机理论研究人员、计算机算法设计人员的参考书。','http://book.douban.com/subject/2208525/','7111215435','http://img3.douban.com/spic/s2657821.jpg','http://img3.douban.com/mpic/s2657821.jpg','http://img3.douban.com/lpic/s2657821.jpg','http://api.douban.com/v2/book/2208525','ff8081813cfaad48013cfaadc99b01cd'),('ff8081813f14477c013f14481f180008','算法设计与分析','','','2009-1','','20.30元','《算法设计与分析》是普通高等教育“十一五”国家级规划教材。《算法设计与分析》以算法设计策略为知识单元，系统地介绍计算机算法的设计方法与分析技巧，以期为计算机科学与技术专业的学生提供广泛而坚实的计算机基础知识。主要内容包括算法分析技术，算法设计技术，P类、NP类及NPC类，证明问题属于NPC类的技术，NPC问题子问题的复杂性，拟多项式变换和图灵归约，NP-难解问题近似算法，近似算法设计技术，等等。\n《算法设计与分析》包括了算法与复杂性领域的主要内容，可以作为高等学校计算机专业高年级本科生和研究生学习计算机算法设计的教材，也可供广大工程技术人员和自学者学习参考。','http://book.douban.com/subject/3569368/','7040258714','http://img3.douban.com/spic/s5993673.jpg','http://img3.douban.com/mpic/s5993673.jpg','http://img3.douban.com/lpic/s5993673.jpg','http://api.douban.com/v2/book/3569368','ff8081813cfaad48013cfaadc99b01cd'),('ff8081813f14477c013f14481f180009','算法设计与分析基础','（美）莱维丁（Levitin/A.）/潘彦','潘彦','2004-6','第1版 (2004年1月1日)','45.0','','http://book.douban.com/subject/1173877/','7302086567','http://img3.douban.com/spic/s9894507.jpg','http://img3.douban.com/mpic/s9894507.jpg','http://img3.douban.com/lpic/s9894507.jpg','http://api.douban.com/v2/book/1173877','ff8081813cfaad48013cfaadc99b01cd'),('ff8081813f14477c013f14481f19000a','算法设计与分析','王晓东','','2003-8','清华大学出版社','29.80元','算法设计与分析，ISBN：9787302061861，作者：王晓东编著','http://book.douban.com/subject/1110376/','7302061866','http://img3.douban.com/spic/s9795730.jpg','http://img3.douban.com/mpic/s9795730.jpg','http://img3.douban.com/lpic/s9795730.jpg','http://api.douban.com/v2/book/1110376','ff8081813cfaad48013cfaadc99b01cd'),('ff8081813f14477c013f14481f19000b','算法设计与分析','陈慧南','','2006-5','电子工业出版社','26.80元','《算法设计与分析:C++语言描述》内容分为3部分：算法和算法分析、算法设计策略及求解困难问题。第1部分介绍问题求解方法、算法复杂度和分析、递归算法和递推关系；第2部分讨论常用的算法设计策略：基本搜索和遍历方法、分治法、贪心法、动态规划法、回溯法和分枝限界法；第3部分介绍NP完全问题、随机算法、近似算法和密码算法。书中还介绍了两种新的数据结构：跳表和伸展树，以及它们特定的算法分析方法，并对现代密码学做了简要论述。','http://book.douban.com/subject/1831832/','7121025922','http://img4.douban.com/spic/s5659928.jpg','http://img4.douban.com/mpic/s5659928.jpg','http://img4.douban.com/lpic/s5659928.jpg','http://api.douban.com/v2/book/1831832','ff8081813cfaad48013cfaadc99b01cd'),('ff8081813f14477c013f14482024000c','Java语言程序设计进阶篇','梁','王镁','2006-8','机械工业出版社','59.00元','《Java语言程序设计进阶篇》(原书第5版)的主要特点：基础篇介绍基础内容，进阶篇介绍高级内容，教师能够按需选择理想的教材。包括面向对象程序设计的深入论述，包含GUI程序设计的基础和扩展实例。提供大量实例，实例中都包括问题求解的详细步骤，可激发学习兴趣。覆盖Java程序设计的众多高级主题。涉及Level I Java认证考试所需的全部主题。提供大量难易程度不同的习题，在作者的网站 http://www.cs.armstrong.edu/liang/intro5e.html）中还提供了1000多道自测题。~','http://book.douban.com/subject/1879446/','7111191935','http://img3.douban.com/spic/s5782886.jpg','http://img3.douban.com/mpic/s5782886.jpg','http://img3.douban.com/lpic/s5782886.jpg','http://api.douban.com/v2/book/1879446','ff8081813cfac4de013cfac4e5c80009'),('ff8081813f14477c013f14482024000d','Java语言程序设计基础篇','梁','王镁','2006-8','机械工业出版社','58.00元','《Java语言程序设计基础篇》(原书第5版本书是Java语言的经典教材，畅销多年不衰。本书以J2SE 5.0版本为基础，采用“先讲基础”的教学方式，循序渐进地介绍了程序设计基础、面向对象的程序设计、图形用户界面设计、异常处理和输入/输出等。另外，本书还全面且深入地覆盖了一些高级主题，包括GUI应用程序、applet、数据结构、多线程、JavaBeans、高级GUI、数据库、JSP、分布式计算等。','http://book.douban.com/subject/1882459/','7111190599','http://img3.douban.com/spic/s10354987.jpg','http://img3.douban.com/mpic/s10354987.jpg','http://img3.douban.com/lpic/s10354987.jpg','http://api.douban.com/v2/book/1882459','ff8081813cfac4de013cfac4e5c80009'),('ff8081813f14477c013f14482024000e','Java程序设计语言','[美] Ken Arnold, James Gosling, David Holmes','陈昊鹏 章程 张思博 李楠','2006-11','人民邮电出版社','69.00元','《Java 程序设计语言(第4版)》主要讲授Java程序设计语言，系统地介绍Java的主要包（即java.lang.*、java.util和java.io）中的大多数类，并以内容丰富的示例对这些类如何工作进行了深入剖析。作者对这部经典著作进行更新，使其反映了Java 2标准版5.0（J2SE 5.0）中主要的增强。本版中增加了几章新内容，专门讨论泛型、枚举以及注解（这些是5.0版引入的主要的新特性），并且加了几小节论述断言和正则表达式。《Java 程序设计语言(第4版)》经过更新后还结合了当今构建健壮、高效和可维护的Java软件的最佳实践。\n《Java 程序设计语言(第4版)》对所有程序员（包括那些经验丰富的程序员在内）都是不可或缺的参考书。','http://book.douban.com/subject/1908274/','7115152977','http://img3.douban.com/spic/s1921456.jpg','http://img3.douban.com/mpic/s1921456.jpg','http://img3.douban.com/lpic/s1921456.jpg','http://api.douban.com/v2/book/1908274','ff8081813cfac4de013cfac4e5c80009'),('ff8081813f14477c013f14482024000f','Java语言程序设计','','','','科学出版社','39.80元','','http://book.douban.com/subject/24301117/','7030372220','http://img3.douban.com/spic/s26635816.jpg','http://img3.douban.com/mpic/s26635816.jpg','http://img3.douban.com/lpic/s26635816.jpg','http://api.douban.com/v2/book/24301117','ff8081813cfac4de013cfac4e5c80009'),('ff8081813f14477c013f144820250010','Java语言程序设计','','','2013-1','哈尔滨工业大学出版社','43.80元','','http://book.douban.com/subject/21810727/','7560335217','http://img3.douban.com/spic/s26612555.jpg','http://img3.douban.com/mpic/s26612555.jpg','http://img3.douban.com/lpic/s26612555.jpg','http://api.douban.com/v2/book/21810727','ff8081813cfac4de013cfac4e5c80009'),('ff8081813f14477c013f144820250011','Java语言程序设计','','','2012-12','清华大学出版社','31.00元','Java语言是目前世界上最流行的计算机编程语言，是一种可以编写跨平台应用软件的程序设计语言。《21世纪高等学校规划教材•计算机应用:Java语言程序设计》重点介绍了Java语言面向对象的程序设计。主要内容包括：Java语言的基本语法、类与对象、继承与多态、图形程序设计、异常处理、多线程、输入输出和网络编程等。目的在于帮助读者建立面向对象的编程思维，通过面向对象的编程理念，真正掌握Java语言编程技术。《21世纪高等学校规划教材•计算机应用:Java语言程序设计》既注重理论讲解，又强调实践技能的锻炼，通过例子介绍语法和理论，说明编程的方法与规范。每章设置学习目标，便于普通读者对整体内容的把握，并提供一定的练习题，便于读者对内容的巩固和提高。','http://book.douban.com/subject/20474549/','7302300585','http://img3.douban.com/spic/s24922580.jpg','http://img3.douban.com/mpic/s24922580.jpg','http://img3.douban.com/lpic/s24922580.jpg','http://api.douban.com/v2/book/20474549','ff8081813cfac4de013cfac4e5c80009');
