INSERT INTO `HOT_BOOK` VALUES ('ff8081813f14477c013f14488e160012',NULL,NULL,'HTML 4 开发人员指南(附CD-ROM)','\n      ','David Kerven','机械工业出版社','7111063643','http://img3.douban.com/spic/s1182807.jpg','http://book.douban.com/subject/1080543/',NULL,'88.00','682',2,'1998-07','1080543','平装','HTML 4 开发人员指南','0.0'),('ff8081813f14477c013f14488ea20013',NULL,NULL,'通信软件设计基础','《普通高等教育十一五国家级规划教材•通信软件设计基础》针对通信软件和通信协议的特点，从通信协议的分析、设计和描述人手，系统地介绍了两种适用于通信软件需求分析阶段和设计阶段的形式化描述语言，即消息跟踪语言MSC和规范说明和描述语言SDL，重点介绍了在电信领域得到广泛应用的SDL语言，并以设计一个微型交换机软件和一个简单通信协议为例，说明如何运用这些形式化语言进行通信软件的需求分析、概要设计和详细设计以及通信协议的分析设计。',NULL,NULL,'7563516085','http://img3.douban.com/spic/s5887227.jpg','http://book.douban.com/subject/3038191/',NULL,'29.00元','239',2,'1970-1','3038191',NULL,'通信软件设计基础','0.0'),('ff8081813f14477c013f14488f470014',NULL,'XML in a nutshell','XML技术手册','本书是全面介绍XML技术的一部权威性宏篇巨著，内容全面详实，并且包含大量示例应用程序和代码段，全面阐明和展示了XML的使用方法。 本书共分四个部分二十三章。第一部分介绍组成内核的基本标准。第二部分讨论主要用于像网页、图书、文章、日记和剧本等叙述型XML文档中的技术。第三部分讨论了数据密集型文档中的XML应用。最后，第四部分包括一系列组成任何“坚果系列”手册核心速查章节。','明斯','中国电力出版社','7508308085','http://img3.douban.com/spic/s1511797.jpg','http://book.douban.com/subject/1231667/',NULL,'59.00','536',2,'2001-11-1','1231667','平装(无盘)','XML 技术手册 ','0.0'),('ff8081813f14477c013f14488fb60015',NULL,NULL,'LATEX入门与提高','全书分成“基本篇”和“提高篇”，基本篇面向初学者，只介绍最基本的TEX命令，学完此篇后就能用LATEX打印自己的论文或讲义，且例子均用中文；提高篇介绍更高级的排版技巧，是供选读或需要时查阅的，各部分相对独立。','万福永','高等教育出版社图书发行部（兰色畅想）','7040104687','http://img3.douban.com/spic/s23533730.jpg','http://book.douban.com/subject/1239849/',NULL,'32.00元','350',2,'2002-2','1239849','简裝本','LATEX入门与提高','7.2'),('ff8081813f14477c013f144890400016',NULL,'Mastering JSP','JSP从入门到精通','本书从JSP最基本的概念到Web站点的设计，系统讲述了基于JSP的应用开发和设计，并提供了完整而实用的例程。全书共分3部分，由16章组成，包括JSP基础、应用程序开发、高级数据库编程、Web应用模型和高级体系结构以及用JSP表示XML文件等内容。本书通俗易懂，由浅入深、偏重应用，适用于所有希望掌握JSP技术的人们，包括初学者和有经验的Web设计人员','Todd Cook','电子工业出版社','7505384511','http://img3.douban.com/spic/s1153647.jpg','http://book.douban.com/subject/1212957/',NULL,'62.00','612',2,'2003-3-1','1212957','平装(无盘)','JSP 从入门到精通 ','0.0'),('ff8081813f14477c013f144890a30017',NULL,'The mythical man-month','人月神话','作者为人们管理复杂项目提供了颇具洞察力的见解，既有很多发人深省的观点，也有大量的软件工程实践。书中的内容来自布鲁克斯在IBM公司System 360家族和OS 360中的项目管理经验。初版的20年后，布鲁克斯重新审视了他原先的观点，增加了一些新的想法和建议。新增加的章节包括：原著中一些核心观点的精华；在经过了一个时代以后，Brooks博士对原先观点新的认识；1986年的经典文章《没有银弹》；对1986年所下论断（在10年内不会出现银弹）现在的认识。','[美] 弗雷德里克·布鲁克斯','清华大学出版社','7302059322','http://img3.douban.com/spic/s1973562.jpg','http://book.douban.com/subject/1102259/',NULL,'29.80元','369',2,'2002-11','1102259','平装','人月神话 ','8.5'),('ff8081813f14477c013f144890f50018',NULL,NULL,'ActionScript权威指南','ActionScript权威指南，ISBN：9787111110859，作者：（美）莫克（Moock,C.）著','莫克','机械工业出版社','7111110854','http://img3.douban.com/spic/s1088703.jpg','http://book.douban.com/subject/1105484/',NULL,'88.00','768',2,'2003-1-1','1105484','平装(无盘)','ActionScript 权威指南','8.6'),('ff8081813f14477c013f1448913e0019',NULL,NULL,'JavaScript权威指南','《JavaScript权威指南(第5版)》全面介绍了JavaScript语言的核心，以及Web浏览器中实现的遗留和标准的DOM。它运用了一些复杂的例子，说明如何处理验证表单数据、使用cookie、创建可移植的DHTML动画等常见任务。《JavaScript权威指南(第5版)》还包括详细的参考手册，涵盖了JavaScript的核心API、遗留的客户端API和W3C标准DOM API，记述了这些API中的每一个JavaScript对象、方法、性质、构造函数、常量和事件处理程序。','弗拉纳根','机械工业','7111216326','http://img3.douban.com/spic/s5860151.jpg','http://book.douban.com/subject/2228378/',NULL,'109.00元','954',2,'2007-8','2228378',NULL,'JavaScript 权威指南','8.8'),('ff8081813f14477c013f144891c3001a',NULL,NULL,'C++ Primer中文版','本书是久负盛名的C++经典教程，其内容是C++大师Stanley B. Lippman丰富的实践经验和C++标准委员会原负责人Josée Lajoie对C++标准深入理解的完美结合，已经帮助全球无数程序员学会了C++。本版对前一版进行了彻底的修订，内容经过了重新组织，更加入了C++ 先驱Barbara E. Moo在C++教学方面的真知灼见。既显著改善了可读性，又充分体现了C++语言的最新进展和当前的业界最佳实践。书中不但新增大量教学辅助内容，用于强调重要的知识点，提醒常见的错误，推荐优秀的编程实践，给出使用提示，还包含大量来自实战的示例和习题。对C++基本概念和技术全面而且权威的阐述，对现代C++编程风格的强调，使本书成为C++初学者的最佳指南；对于中高级程序员，本书也是不可或缺的参考书。本书的前言阐述了 第4版和前一版的不同之处。','Barbara E.Moo','人民邮电出版社','7115145547','http://img3.douban.com/spic/s1638975.jpg','http://book.douban.com/subject/1767741/',NULL,'99.00元','745',2,'2006','1767741','16开','C++ Primer 中文版','9.2'),('ff8081813f14477c013f1448921d001b',NULL,NULL,'C++语言基本程序设计',NULL,'裘宗燕','科学出版社','7030111257','http://img3.douban.com/spic/s9808490.jpg','http://book.douban.com/subject/1247558/',NULL,'35.00元','419',2,'2003-3','1247558','简裝本','C++ 语言基本程序设计','0.0'),('ff8081813f14477c013f14489292001c',NULL,NULL,'MFC程序设计Using Visual C++ 6.0',NULL,'唐克','北京希望电子出版社','7900118608','http://img3.douban.com/pics/book-default-small.gif','http://book.douban.com/subject/1241092/',NULL,'46.0','446',2,'2002-10','1241092','平装','MFC 程序设计 : Using Visual C++ 6.0','0.0'),('ff8081813f14477c013f144893d5001d',NULL,'Database processing : fundamentals, design, and implementation','数据库处理(基础设计与实现第8版)/国外计算机科学教材系列 (平装)','本书是专为高等院校教授数据库技术撰写的教科书。共分为七大部分，讨论了数据库处理基础、数据建模、执行关系数据库、在Web上发布数据库以及面向对象数据库处理。较之第七版，本版强调了XML, ASP及多项技术在数据库处理中越发显现出来的重要性。本书中提供了使用Internet技术发布数据库的最新信息，涉及的技术包括三层结构、Web服务器脚本、XML和OLE DB。本书介绍的最新数据库技术有助于读者设计及使用最新业务和商业应用程序。','克罗恩克','电子工业出版社','7505382454','http://img3.douban.com/spic/s1218206.jpg','http://book.douban.com/subject/1126303/',NULL,'49.0','506',2,'2003-7','1126303','平装','数据库处理 : 基础、设计与实现 ','0.0'),('ff8081813f14477c013f1448942d001e',NULL,'Java design patterns a tutorial','大话设计模式','《大话设计模式》通篇都是以情景对话的形式，用多个小故事或编程示例来组织讲解GoF（设计模式的经典名著——Design Patterns: Elements of Reusable Object-Oriented Software，中译本名为《设计模式——可复用面向对象软件的基础》的四位作者Erich Gamma、Richard Helm、Ralph Johnson，以及JohnVlissides，这四人常被称为GangofFour，即四人组，简称GoF）总结的23个设计模式。本书共分为29章。其中，第1、3、4、5章着重讲解了面向对象的意义、好处以及几个重要的设计原则；第2章，以及第6到第28章详细讲解了23个设计模式；第29章是对设计模式的全面总结。附录部分是通过一个例子的演变为初学者介绍了面向对象的基本概念。本书的特色是通过小菜与大鸟的趣味问答，在讲解程序的不断重构和演变过程中，把设计模式的学习门槛降低，让初学者可以更加容易地理解——为什么这样设计才是好的？是怎样想到这样设计的？以达到不但授之以“鱼”，还授之以“渔”的目的。引导读者体会设计演变过程中蕴藏的大智慧。','程杰','清华大学出版社','7302162069','http://img4.douban.com/spic/s6908318.jpg','http://book.douban.com/subject/2334288/',NULL,'45.00元','368',2,'2007-12','2334288',NULL,'Java 设计模式 ','8.4'),('ff8081813f14477c013f144894e9001f',NULL,NULL,'数据结构与算法分析','《数据结构与算法分析:C语言描述(原书第2版)》内容简介：书中详细介绍了当前流行的论题和新的变化，讨论了算法设计技巧，并在研究算法的性能、效率以及对运行时间分析的基础上考查了一些高级数据结构，从历史的角度和近年的进展对数据结构的活跃领域进行了简要的概括。由于《数据结构与算法分析:C语言描述(原书第2版)》选材新颖，方法实用，题例丰富，取舍得当。《数据结构与算法分析:C语言描述(原书第2版)》的目的是培养学生良好的程序设计技巧和熟练的算法分析能力，使得他们能够开发出高效率的程序。从服务于实践又锻炼学生实际能力出发，书中提供了大部算法的C程序和伪码例程，但并不是全部。一些程序可从互联网上获得。\n《数据结构与算法分析:C语言描述(原书第2版)》是《Data Structures and Algorithm Analysis in C》一书第2版的简体中译本。原书曾被评为20世纪顶尖的30部计算机著作之一，作者Mark Allen Weiss在数据结构和算法分析方面卓有建树，他的数据结构和算法分析的著作尤其畅销，并受到广泛好评．已被世界500余所大学用作教材。 \n在《数据结构与算法分析:C语言描述(原书第2版)》中，作者更加精炼并强化了他对算法和数据结构方面创新的处理方法。通过C程序的实现，着重阐述了抽象数据类型的概念，并对算法的效率、性能和运行时间进行了分析。 \n全书特点如下： \n●专用一章来讨论算法设计技巧，包括贪婪算法、分治算法、动态规划、随机化算法以及回溯算法 \n●介绍了当前流行的论题和新的数据结构，如斐波那契堆、斜堆、二项队列、跳跃表和伸展树 \n●安排一章专门讨论摊还分析，考查书中介绍的一些高级数据结构 \n●新开辟一章讨论高级数据结构以及它们的实现，其中包括红黑树、自顶向下伸展树。treap树、k-d树、配对堆以及其他相关内容 \n●合并了堆排序平均情况分析的一些新结果 \n《数据结构与算法分析:C语言描述(原书第2版)》是国外数据结构与算法分析方面的标准教材，介绍了数据结构(大量数据的组织方法)以及算法分析(算法运行时间的估算)。《数据结构与算法分析:C语言描述(原书第2版)》的编写目标是同时讲授好的程序设计和算法分析技巧，使读者可以开发出具有最高效率的程序。 《数据结构与算法分析:C语言描述(原书第2版)》可作为高级数据结构课程或研究生一年级算法分析课程的教材，使用《数据结构与算法分析:C语言描述(原书第2版)》需具有一些中级程序设计知识，还需要离散数学的一些背景知识。\n\n海报：','Mark Allen Weiss (维斯)','机械工业出版社','711112748X','http://img3.douban.com/spic/s1106991.jpg','http://book.douban.com/subject/1139426/',NULL,'35.00元','391',2,'2004-1-1','1139426','平装','数据结构 : Java版','8.9'),('ff8081813f14477c013f144895500020',NULL,NULL,'Java算法','国外经典教材·计算机科学与技术。\n    本书深入介绍了图算法。书中分别对图属性和类型、图搜索、有向图、最小生成树、最短路径以及网络流的有关内容进行了透彻的讨论。在此不仅对基本内容做了全面的阐述，而且对经典算法也提供了详尽的分析，同时还涵盖了有关的高级主题。全书既强调了与实用有关的内容，在分析和理论研究上也很有深度。另外，对于书中提供的算法，读者可以放心地实现和调试，并用这些算法一解决问题。\n    本书内容全面、论述清晰，适合于计算机科学和数学领域各个层次的人员使用。','塞奇威克','清华大学出版社','7302086540','http://img3.douban.com/spic/s3321873.jpg','http://book.douban.com/subject/1174296/',NULL,'45.0','385',2,'2004-7','1174296','平装','Java 算法 . 第2卷 , 图算法','0.0'),('ff8081813f14477c013f144895d50021',NULL,NULL,'Java算法','《Java算法》用Java语言全面实现了当今最重要的计算机算法，并用大量图表和数学公式对算法进行了详尽的描述和分析。全书共分3卷，本书是其中的第1卷（第1至第4部分）。内容包括基本概念（第1部分）、数据结构（第2部分）、排序算法（第3部分）和查找算法（第4部分）。本书概念清楚，内容翔实，新颖，由浅入深地描述了算法。本书可作为高等院校计算机相关专业本科生和研究生的教材和补充读物，也可作为Java爱好','塞奇威克','清华大学出版社','7302086389','http://img3.douban.com/spic/s9893857.jpg','http://book.douban.com/subject/1173416/',NULL,'59.0','552',2,'2004-06-01','1173416','平装','Java 算法 . 第1卷','7.7'),('ff8081813f14477c013f144896220022',NULL,'Algorithms design techniques and analysis','算法设计技巧与分析','本书是国际著名算法专家李德财教授主编的系列丛书“Lecture Notes Series on Computing”中的一本。本书涵盖了绝大多数算法设计中的一般技术，在表达每一种技术时，阐述它的应用背景，注意用与其他技术比较的方法说明它的特征，并提供大量相应实际问题的例子。本书同时也强调了对每一种算法的详细的复杂性分析。全书分七部分19章，从算法设计和算法分析的基本概念和方法入手，先后介绍了递归技术、分治、动态规划、贪心算法、图的遍历等技术，对NP完全问题进行了基本但清楚的讨论。对概率算法、近似算法和计算几何这些近年来发展迅猛的领域也用一定的篇幅讲述了基本内容。书中每章后都附有大量的练习题，有利于读者对书中内容的理解和应用。 \n    本书结构简明，内容丰富，适合于作为计算机学科以及相关学科算法课程的教材和参考书，尤其适宜于学过数据结构和离散数学课程之后的算法课教材。同时也可作为从事算法研究的一本好的入门书。','阿苏外耶','电子工业出版社','712100108X','http://img3.douban.com/spic/s1408354.jpg','http://book.douban.com/subject/1177989/',NULL,'33.00元','318',2,'2004-8-1','1177989','平装(无盘)','算法设计技巧与分析 ','7.5'),('ff8081813f14477c013f1448966d0023',NULL,'UNIX systems programming : communication, concurrency and threads','UNIX系统编程','本书深入阐述了能使UNIX操作系统发挥出量大功效的软件设计方法，对UNIX编程的精髓进行了清晰易懂的介绍。两位作者具有多年教学与科研经验，匠心独运，精耕细做，以一些用来说明如何使用系统调用的短小代码段开始，巧妙地过渡到实际项目中，逐渐在拓展了读者的技术水平。本书对通信、并发和多线程问题进行了透彻的研究；对复杂的概念，比如信号和并发，进行了全面、明晰的解释，并以此闻名。本书的特色还在于它提供了大量实例、练习、可重用的代码以及有和于网络通信程序的简化了的库。\n　　本书同时也是一本基于最新的UNIX标准的完备的参考书，它完全覆盖了与文件、信号、信号量、POSIX线程和客户机-服务器通信相关的内容。此外，本版本中新增拉在于Web、UDP和服务器性能的章节也为本书增色不少。书中包含大量有趣的项目设计及其参考答案，例如命令解释程序、WWW重定向、因特网音频广播、服务器性能等，这些项目设计稍加完善就可以成为可用的程序，可供软件开发人员参考。\n　　本书的Web站点http://usp.cs,utsa,edu/usp为读者提供了大量的资料，内容包括所有可下载的程序，这些程序可以免费使用。此外，这个站点中还包含到模拟器、测试工具、作者准备的课程资料以及勘误表的链接。\n　　本书是UNIX系统编程的经典教材，并基于最新的UNIX标准进行了更新，其内容完全覆盖文件、信号、POSIX线程、UDP、Web和客户机－服务器等相关内容，并对通信、并发和多线程问题进行了透彻的研究，对复杂的概念进行了全面、完善以及明晰的解释，并以此而闻名。本书不仅提供了大量实例和练习，还专门设计了有针对性的项目，并给出了参考答案，帮助读者理解相关的概念，增强应用能力。本书适合作为高等院校计算机专业教材，也可供软件开发人员参考。','罗宾斯','机械工业出版社','7111161904','http://img5.douban.com/spic/s1321839.jpg','http://book.douban.com/subject/1314538/',NULL,'78.00元','656',2,'2005-5','1314538','平装(无盘)','UNIX 系统编程 ','8.5'),('ff8081813f14477c013f144896b80024',NULL,'Thinking in Java','Java 编程思想','\n      ','Bruce Eckel','\n      ','7111092864','http://img3.douban.com/spic/s1150244.jpg','http://book.douban.com/subject/1094798/',NULL,'69.00','1164',2,'2002-1-1','1094798','平装（带盘）','Java 编程思想 ','8.1'),('ff8081813f14477c013f14511b810025',NULL,NULL,'金融计算机网络应用层通信协议工程',NULL,NULL,NULL,'711507139X','http://img3.douban.com/pics/book-default-small.gif','http://book.douban.com/subject/3947307/',NULL,'15.00元',NULL,2,NULL,'3947307',NULL,'计算机网络协议工程','0.0'),('ff8081813f14477c013f14511c070026',NULL,NULL,'面向对象的JAVA语言程序设计','本书介绍了Java语言的基本语法和程序设计方法，全书共12章，分别介绍了Java语言的背景、数据类型、运算符、控制流、数组、面向对象程序设计、异常处理、线程、Java APPlet、图形用户界面、输入／输出处理和网络通信。    本书可作为高等学校理工科学生教材或教学参考书，也可作为工程技术人员的培训教材或自学参考书。','孟祥武','北京邮电大学出版社','7563504966','http://img3.douban.com/pics/book-default-small.gif','http://book.douban.com/subject/1243682/',NULL,'16.00元',NULL,2,'2001-03-01','1243682',NULL,'面向对象的 Java 语言程序设计','0.0'),('ff8081813f1451a5013f1451c4740000',NULL,'Thinking in Java','Java 编程思想','\n      ','Bruce Eckel','\n      ','7111092864','http://img3.douban.com/spic/s1150244.jpg','http://book.douban.com/subject/1094798/','search2/s_detail.jsp?sid=01h0015191&sno=1','69.00','1164',0,'2002-1-1','1094798','平装（带盘）','Java 编程思想','8.1'),('ff8081813f1451a5013f1451c5e10001',NULL,'','C++ Primer中文版','本书是久负盛名的C++经典教程，其内容是C++大师Stanley B. Lippman丰富的实践经验和C++标准委员会原负责人Josée Lajoie对C++标准深入理解的完美结合，已经帮助全球无数程序员学会了C++。本版对前一版进行了彻底的修订，内容经过了重新组织，更加入了C++ 先驱Barbara E. Moo在C++教学方面的真知灼见。既显著改善了可读性，又充分体现了C++语言的最新进展和当前的业界最佳实践。书中不但新增大量教学辅助内容，用于强调重要的知识点，提醒常见的错误，推荐优秀的编程实践，给出使用提示，还包含大量来自实战的示例和习题。对C++基本概念和技术全面而且权威的阐述，对现代C++编程风格的强调，使本书成为C++初学者的最佳指南；对于中高级程序员，本书也是不可或缺的参考书。本书的前言阐述了 第4版和前一版的不同之处。','Barbara E.Moo','人民邮电出版社','7115145547','http://img3.douban.com/spic/s1638975.jpg','http://book.douban.com/subject/1767741/','search2/s_detail.jsp?sid=0199056410&sno=3','99.00元','745',0,'2006','1767741','16开','C++ Primer 中文版','9.2'),('ff8081813f1451a5013f1451c7ae0002',NULL,'','信息论与编码','《信息论与编码(第3版)》系统论述香农信息论的基本理论，介绍编码的基本方法。全书共分12章。内容包括：信息的定义、信息论的基本思路；单符号离散信源与信道、信息熵、互信息、信道容量、数据处理定理、加权熵、效用信息熵；多符号离散信源与信道、极限熵、独立并列信道的信道容量；连续信源与信道、相对熵、高斯白噪声加性信道的信道容量；无失真信源编码定理、霍夫曼编码方法；抗干扰信道编码定理、线性分组码、汉明码与扩展汉明码；限失真信源编码定理、信息率-失真函数、数据压缩原理、信息价值、广义信息率-失真函数；信源-信道编码定理；网络信息理论等。\n《信息论与编码(第3版)》可作为高等院校、科研院所相关专业的研究生、高年级本科生的教材或教学参考书，也可供从事信息理论、信息技术和信息科学的教学、科研和工程技术人员参考。','姜丹',NULL,'7312023290','http://img3.douban.com/spic/s6138475.jpg','http://book.douban.com/subject/4703192/','search2/s_detail.jsp?sid=01h0054849&sno=4','70.00元','797',0,'2009-12','4703192',NULL,'信息论与编码','8.1'),('ff8081813f1451a5013f1451c9560003',NULL,'','光波导理论与技术','《光波导理论与技术》系统地讲述了目前发展比较迅速的光波导传输理论和光通信器件的工作原理。《光波导理论与技术》的第1章是对光通信及相应的器件的一个概略介绍。第2章是电磁场理论基础，介绍经典电磁理论的主要结论。第3章是几何光学分析方法，讲述光波导中光的传播规律。第4章讲述平面波导及条形波导的模式理论。第5章介绍光纤的模式理论。第6章讲述光纤的色散特性和色散补偿技术。第7章是光纤的非线性传输理论，讲述光纤中重要的非线性效应。第8章介绍光通信系统中常用的无源光器件的结构、工作原理和特性。第9章讲述有源光器件的结构、工作原理及特性。\n《光波导理论与技术》的作者长年为本科生和研究生讲授《光纤通信》、《光纤传输理论》课程，因此《光波导理论与技术》可以作为相关专业的本科生和研究生的教材。对于从事与光纤通信相关工作的工程技术人员，《光波导理论与技术》也可以提供有益的参考。','崔敏','人民邮电出版社','7115107009','http://img3.douban.com/spic/s24492185.jpg','http://book.douban.com/subject/1232028/','search2/s_detail.jsp?sid=0199054012&sno=5','38.00元','343',0,'2002-12','1232028','平装(无盘)','光波导理论与技术','0.0'),('ff8081813f1451a5013f1451ca130004',NULL,'','鸟哥的Linux私房菜.基础学习篇（第三版）','本书是最具知名度的Linux入门书《鸟哥的Linux私房菜基础学习篇》的最新版，全面而详细地介绍了Linux操作系统。全书分为5个部分：第一部分着重说明Linux的起源及功能，如何规划和安装Linux主机；第二部分介绍Linux的文件系统、文件、目录与磁盘的管理；第三部分介绍文字模式接口 shell和管理系统的好帮手shell脚本，另外还介绍了文字编辑器vi和vim的使用方法；第四部分介绍了对于系统安全非常重要的Linux账号的管理，以及主机系统与程序的管理，如查看进程、任务分配和作业管理；第五部分介绍了系统管理员(root)的管理事项，如了解系统运行状况、系统服务，针对登录文件进行解析，对系统进行备份以及核心的管理等。\n本书内容丰富全面，基本概念的讲解非常细致，深入浅出。各种功能和命令的介绍，都配以大量的实例操作和详尽的解析。本书是初学者学习Linux不可多得的一本入门好书。','鸟哥','人民邮电出版社','7115226261','http://img3.douban.com/spic/s4399937.jpg','http://book.douban.com/subject/4889838/','search2/s_detail.jsp?sid=01h0024174&sno=6','88.00元','778',0,'2010-6-28','4889838',NULL,'鸟哥的 LINUX 私房菜 , 基础学习篇','9.2'),('ff8081813f1451a5013f1451ca840005',NULL,'','UNIX网络编程','《UNIX网络编程》(第1卷)(套接口API第3版)第1版和第2版由已故UNIX网络专家W. Richard Stevens博士独自编写。《UNIX网络编程》(第1卷)(套接口API第3版)是3版，由世界著名网络专家Bill Fenner和Andrew M. Rudoff执笔，根据近几年网络技术的发展，对上一版进行全面修订，增添了IPv6的更新过的信息、SCTP协议和密钥管理套接口的内容，删除了X/Open传输接口的内容。\n《UNIX网络编程》(第1卷)(套接口API第3版)内容详尽且具权威性，几乎每章都提供精选的习题，是计算机和网络专业高年级本科生和研究生的首选教材，《UNIX网络编程》(第1卷)(套接口API第3版)也可作为网络研究和开发人员的自学教材和参考书。','鲁道夫','清华大学出版社','7302119740','http://img3.douban.com/spic/s1613283.jpg','http://book.douban.com/subject/1500149/','search2/s_detail.jsp?sid=01h0035043&sno=7','98.0','848',0,'2006-1','1500149','平装','UNIX 网络编程 . 第1卷 , 套接口API','9.5'),('ff8081813f1451a5013f1451cb2f0006',NULL,'','程序员面试宝典','本书取材于各大IT公司历年面试真题（包括笔试题、口试题、电话面试、英语面试，以及逻辑测试和智商测试）。通过精确详细的分类，把在应聘程序员（含网络、测试等）过程中所遇见的常见考点分为21章。不仅对传统的C系语言考点做了详尽的解说，包括面向对象问题、sizeof问题、const问题、数据结构问题等。还根据外企出题最新特点，针对设计模式问题、C#问题、网络问题、数据库问题、NET问题等，做了深入的说明。\n　　最后本书着力讲述了如何进行英语面试和电话面试，并给出了大量实际英语面试中的问题、参考答案，以及常用词汇，尝试解决程序员应聘外企时语言问题造成的瓶颈。本书的面试题并非简单的罗列。除了对每道题目都有详细的解析和回答外，对相关知识点还有扩展说明。\n　　希望真正做到由点成线，举一反三。本书对于读者从求职就业到提升计算机专业知识都有显著的帮助。','欧立奇、刘洋、段韬/国别：中国大陆','电子工业出版社','7121027895','http://img3.douban.com/spic/s24417102.jpg','http://book.douban.com/subject/1896792/','search2/s_detail.jsp?sid=01h0218227&sno=9','39.00元','365',0,'2006-7','1896792','简裝本','程序员面试宝典','6.7'),('ff8081813f1451a5013f1451cbb70007',NULL,'','排队论','《排队论(第2版)》是一本介绍排队论的初等理论和方法的教科书，全书共分8章，前两章为预备知识，第3章为M／M／1排队模型，第4章为M／M／n排队模型，第5章为非马尔可夫排队模型，第6章为离散时间排队模型，第7、8章为特殊排队模型及优化模型。《排队论(第2版)》叙述简练并附有大量例题，给出习题解答或提示便于读者自学。\n《排队论(第2版)》可作为信息与通信工程，计算机及其应用。管理与运筹工程、铁路(交通)运输等专业本科生的教材或研究生的参考教材，也可作为相关的工程技术人员的参考书。','陆传赉',NULL,'7563520759','http://img3.douban.com/spic/s4189940.jpg','http://book.douban.com/subject/4155355/','search2/s_detail.jsp?sid=0194004594&sno=10','25.00元','231',0,'2009-10','4155355',NULL,'排队论','0.0'),('ff8081813f1451a5013f1451cc440008',NULL,'Communication networks theory','通信网理论基础','《通信网理论基础(修订版)》系统介绍了通信网的理论基础。全书共分为6章，分别介绍了通信网的概念和网络的基本组成，网络的业务分析和排队论原理，多址接入系统分析，通信网结构，通信网中的流量优化，通信网中的可靠性。\n《通信网理论基础(修订版)》可作为高等院校信息与通信工程相关专业高年级本科生和研究生的教材，也可作为通信工程技术人员和科研人员的参考用书。',NULL,NULL,'711519758X','http://img3.douban.com/spic/s6082701.jpg','http://book.douban.com/subject/4089785/','search2/s_detail.jsp?sid=01h0172972&sno=1','28.00元','216',0,'2009-10','4089785',NULL,'通信网理论基础','0.0'),('ff8081813f1451a5013f1451ccb10009',NULL,'','Java Web设计模式之道','《Java Web设计模式之道》全面讲解了JavaWeb设计模式，集理论与实战于一体，结合创新与发散思维，为读者提供思维上、方法上的启发。《Java Web设计模式之道》结合JavaWeb示例项目全面讲解了29个设计模式，最后通过一个实战项目学习设计模式是怎么结合到实际项目中的。','蒋海昌','清华大学出版社','730231148X','http://img3.douban.com/spic/s25979222.jpg','http://book.douban.com/subject/21359467/','search2/s_detail.jsp?sid=01h0257222&sno=2','38.00元','259',0,'2013-2','21359467',NULL,'Java Web设计模式之道','0.0'),('ff8081813f1451a5013f1451cd3a000a',NULL,'','OPNET Modeler与网络仿真','《OPNET Modeler与网络仿真》旨在帮助读者在阅读软件帮助文件时，更方便快捷地使用OPNET Modeler(下文将其简称为OPNET)。全书共分为12章，通过3个部分完成了对OPNET仿真环境和工具集的介绍、OPNET的编程思想和OPNET系统建模实例的讲解以及OPNET的高级应用等。第1～4章介绍了OPNET的基础知识，使读者能够进行一些简单网络的设置；第5～9章对OPNET的建模特点进行了详细的讲解，使读者能够自定义设置网络；第10～12章对．WiMAX网络进行了简单的介绍，并讲述了搭建WiMAX系统模型的整个过程。','张铭','人民邮电','711516438X','http://img3.douban.com/spic/s8826155.jpg','http://book.douban.com/subject/2236640/','search2/s_detail.jsp?sid=0199066250&sno=3','33.00元','255',0,'2007-9','2236640',NULL,'OPNET Modeler 与网络仿真','0.0'),('ff8081813f1451a5013f1451cdab000b',NULL,'Discrete-time speech signal processing : 原理与应用principles and practice','离散时间语音信号处理','本书可称为语音信号处理领域最新最好的指导书和参考资料。作者在所开设的麻省理工学院研究生课程的基础上，介绍了语音信号处理的主要原理、重要应用以及最新研究动态，并且指出了新的研究方向的进展和局限性。全书在理论和应用之间达到了极好的平衡。首先讲解了用于理解离散时间语音信号处理的完整理论基础，然后介绍了语音信号处理方面的重要研究进展，其中包括正弦语音处理、语音时频分析以及非线性声学语音产生模型，而这些进展情况在以往任何一本语音信号处理教科书中都不曾提及。本书在应用部分深入介绍了以下内容：语音编码、语音增强、语音综合、说话人识别、语音降噪、语音信号恢复、动态范围压缩等。值得注意的是，在本书的原理和应用部分恰当地加入了非常完整的实例和MATLAB习题。\n    本书适合作为数字语音处理及相关方向的研究生教材，也可供有关领域的研究人员参考阅读。','夸特尔瑞','电子工业出版社','7505399470','http://img3.douban.com/spic/s24597225.jpg','http://book.douban.com/subject/1184057/','search2/s_detail.jsp?sid=0199076500&sno=4','59.00元','615',0,'2004-8','1184057','简裝本','离散时间语音信号处理','8.6'),('ff8081813f1451a5013f1451ce15000c',NULL,'','Flash动画设计专家门诊',NULL,'闪吧','清华大学出版社','7302099375','http://img3.douban.com/spic/s1281177.jpg','http://book.douban.com/subject/1226242/','search2/s_detail.jsp?sid=0199076765&sno=5','39.00元','405',0,'2005-1','1226242',NULL,'Flash 动画设计专家门诊','0.0'),('ff8081813f1451a5013f1451cf82000d',NULL,'','信息论基础教程习题解答与实验指导','《21世纪信息通信系列教材•信息论基础教程习题解答与实验指导(第2版)》为《信息论基础教程（第2版）》的配套教材，包括原书各章的习题解答、新增的习题和解答以及上机实验的参考程序等。此次修订，更加强调实践环节，编写了9个实验的实验指导：信道容量的迭代算法、唯一可译码判决准则、香农编码、霍夫曼编码、费诺编码、lzw编码、bsc模拟器、hamming（7，4）编译码器和通信系统仿真实验，每个实验都给出了实验目的、实验要求、算法和参考程序。\n《21世纪信息通信系列教材•信息论基础教程习题解答与实验指导(第2版)》可作为高等院校电子信息类相关专业的高年级本科生及研究生教学配套教材，也可供其他专业技术人员自学信息论用。',NULL,NULL,'7563525467','http://img3.douban.com/spic/s6302093.jpg','http://book.douban.com/subject/5992374/','search2/s_detail.jsp?sid=01h0055627&sno=6','19.00元','162',0,'2011-1','5992374',NULL,'信息论基础教程习题解答与实验指导','0.0'),('ff8081813f1451a5013f1451d055000e',NULL,'','数字信号处理','《国外电子与通信教材系列·数字信号处理(第4版)》全面系统地阐述了数字信号处理的基础知识，其中前10章讲述了确定性数字信号处理的知识，包括离散时间信号及系统的介绍、z变换、傅里叶变换、频率分析以及滤波器设计等。后4章则介绍了随机数字信号处理的知识，主要学习多速率数字信号处理、线性预测、自适应滤波以及功率谱估计。《国外电子与通信教材系列·数字信号处理(第4版)》内容全面丰富、系统性强、概念清晰、叙述深入浅出，为了帮助读者深刻理解基本理论和分析方法，书中列举了大量的精选例题，同时还给出了许多基于MATLAB的仿真实验。另外，在各章的最后还附有习题，以帮助读者进一步巩固所学知识。','普埃克','电子工业','7121034964','http://img3.douban.com/spic/s5863416.jpg','http://book.douban.com/subject/2151838/','search2/s_detail.jsp?sid=01h0110774&sno=7','78.00元','807',0,'2007-6','2151838',NULL,'语音信号处理','8.1'),('ff8081813f1451a5013f1451d130000f',NULL,'','国际商务谈判','国际商务谈判，ISBN：9787542936851，作者：张燕 编',NULL,NULL,'7542936859','http://img3.douban.com/spic/s25664704.jpg','http://book.douban.com/subject/20476936/','search2/s_detail.jsp?sid=01h0124996&sno=8','39.00元','321',0,'2012-12','20476936',NULL,'国际商务谈判','0.0'),('ff8081813f1451a5013f1451d1d70010',NULL,'Algorithms in C : fundamentals, data structures, sorting, searching . 第1-4部分Parts 1-4 , 基础知识、数据结构、排序及搜索','算法：C语言实现','《算法:C语言实现(第1-4部分)基础知识、数据结构、排序及搜索(原书第3版)》细腻讲解计算机算法的C语言实现。全书分为四部分，共16章。包括基本算法分析原理，基本数据结构、抽象数据结构、递归和树等数据结构知识，选择排序、插入排序、冒泡排序、希尔排序、快速排序方法、归并和归并排序方法、优先队列与堆排序方法、基数排序方法以及特殊用途的排序方法，并比较了各种排序方法的性能特征，在进一步讲解符号表、树等抽象数据类型的基础上，重点讨论散列方法、基数搜索以及外部搜索方法。书中提供了用C语言描述的完整算法源程序，并且配有丰富的插图和练习，还包含大量简洁的实现将理论和实践成功地相结合，这些实现均可用在真实应用上。\n《算法:C语言实现(第1-4部分)基础知识、数据结构、排序及搜索(原书第3版)》内容丰富，具有很强的实用价值，适合作为高等院校计算机及相关专业本科生算法课程的教材，也是广大研究人员的极佳参考读物。','塞奇威克','机械工业出版社','7111275713','http://img3.douban.com/spic/s6083105.jpg','http://book.douban.com/subject/4065258/','search2/s_detail.jsp?sid=01h0172942&sno=9','79.00元','456',0,'2009-10','4065258',NULL,'算法 : C 语言实现','8.7'),('ff8081813f1451a5013f1451d30c0011',NULL,'The island','岛·瑞雷克','《鄂商》杂志创刊于2007年11月，是一本以湖北企业和企业家为重点报道对象的本土财经新闻月刊，受众主要面向湖北内外大中型企业管理层、民营企业创业者、政府高级官员以及经济学界人士。\n作为湖北财经第一刊，《鄂商》杂志以“湖北发展能见度”为办刊宗旨，立足湖北发展现状，追求国际视野下的新闻专业主义，一直致力于为所有关注湖北发展的人士提供深度、理性、权威的本土财经新闻报道，以推动湖北经济的健康发展。\n《鄂商》杂志通过报道湖北内外热点鄂商新闻人物、焦点鄂企最新动态及幕后新闻、湖北企业界关注的行业信息和市场动态以及对企业经营与财富生活有独特感悟和实践的个性鄂商，倾力服务当代鄂商群体，大力倡导“新鄂商精神”，展天下鄂商风云之势，为天下鄂商立志，立言，立行，立传。\n《鄂商》杂志与湖北省各级工商联（商会）和企业家协会以及异地湖北商会保持着紧密且良好的战略合作伙伴关系。\n截止2009年12月市场数据统计，《鄂商》杂志目前期发行量为43000册,发行区域涵盖湖北全省和郑州、长沙、合肥、重庆、南昌等中西部地区重要城市以及异地湖北商会。\n《鄂商网》www.hubeibusiness.com由《鄂商》杂志采编团队向所有关注湖北经济发展的人士提供全方位、原创、权威的本土财经新闻报道，向希望深刻认知湖北的读者提供可信赖的财经信息源，以客观、专业的视角提供精心策划的热点新闻专题和特刊。\n《鄂商网》延续《鄂商》杂志“湖北发展能见度”的编辑理念，是每日实时更新的全原创、高品质、可信赖的区域性财经新闻网站。\n重点板块：封面人物、封面故事、特别报道；\n价值板块：鄂商观察、热点新闻、宏观/产经、商业/金融、公司/人物；\n思想板块：鄂商研究院、鄂商档案、鄂商生活、鄂商理事会',NULL,NULL,NULL,'http://img3.douban.com/spic/s1691755.jpg','http://book.douban.com/subject/1834343/','search2/s_detail.jsp?sid=01h0174169&sno=10',NULL,NULL,0,NULL,'1834343',NULL,'岛','6.4'),('ff8081813f1451a5013f1451d3b10012',NULL,'Introduction to algorithms','算法导论','这本书深入浅出，全面地介绍了计算机算法。对每一个算法的分析既易于理解又十分有趣，并保持了数学严谨性。本书的设计目标全面，适用于多种用途。涵盖的内容有：算法在计算中的作用，概率分析和随机算法的介绍。书中专门讨论了线性规划，介绍了动态规划的两个应用，随机化和线性规划技术的近似算法等，还有有关递归求解、快速排序中用到的划分方法与期望线性时间顺序统计算法，以及对贪心算法元素的讨论。此书还介绍了对强连通子图算法正确性的证明，对哈密顿回路和子集求和问题的NP完全性的证明等内容。全书提供了900多个练习题和思考题以及叙述较为详细的实例研究。','Clifford Stein','机械工业出版社','7111187776','http://img3.douban.com/spic/s1959967.jpg','http://book.douban.com/subject/1885170/','search2/s_detail.jsp?sid=01h0060391&sno=2','85.00元','754',0,'2006-9','1885170','平装','算法导论','9.4'),('ff8081813f1451a5013f1451d40d0013',NULL,'','Qt Creator快速入门','《Qt Creator快速入门》作为全面介绍Qt、QtCreator和QtQuick的入门级教材，也是市面上第一套详细介绍QtCreator和QtQuick的教材。书中的内容包含了Qt基础、图形动画、多媒体、数据库、网络通信、WebKit以及QtQuick等所有基本的应用内容。','霍亚飞',NULL,'7512407831','http://img3.douban.com/spic/s10298804.jpg','http://book.douban.com/subject/10745760/','search2/s_detail.jsp?sid=01h0245074&sno=3','59.00元','465',0,'2012-5','10745760',NULL,'Qt Creator快速入门','0.0'),('ff8081813f1451a5013f1451d4a30014',NULL,'The Linux command line','Linux命令行大全','《Linux命令行大全》分为四部分。第一部分开始了对命令行基本语言的学习之旅，包括命令结构、文件系统的导引、命令行的编辑以及关于命令的帮助系统和使用手册。第二部分主要讲述配置文件的编辑，用于计算机操作的命令行控制。第三部分讲述了从命令行开始执行的常规任务。类UNIX操作系统，比如Linux，包含了很多“经典的”命令行程序，这些程序可以高效地对数据进行操作。第四部分介绍了shell编程，这是一个公认的初级技术，并且容易学习，它可以使很多常见的系统任务自动运行。通过学习shell编程，读者也可以熟悉其他编程语言的使用。','William E. Shotts','人民邮电出版社','7115307458','http://img3.douban.com/spic/s26242066.jpg','http://book.douban.com/subject/22226727/','search2/s_detail.jsp?sid=01h0258743&sno=4','69.00元','428',0,'2013-3','22226727',NULL,'Linux命令行大全','0.0'),('ff8081813f1451a5013f1451d5630015',NULL,'Thinking in C++ . Volume one , Introduction to standard C++','C++编程思想（第1卷）','《C++编程思考》第2版与第1版相比，在章节安排上有以下改变。增加了两章：“对象的创建与使用”和“C++中的C”，前者与“对象导言”实际上是第1版“对象的演化”一章的彻底重写，增加了近几年面向对象方法和编程方法的最瓣研究与实践的有效成果，后者的添加使不熟悉C的读者可以直接使用这本书。删去了四章：“输入输出流介绍”、“多重继承”、“异常处理”和“运行时类型识别”，删去的内容属于C++中较复杂的主题，作者将它们连同C++标准完成后又增加的一些内容放到第2卷中，使得第1卷的内容更加集中，供不同程度的读者选择阅读。需要强调的是，第2版的改变不仅体现在这些章节的调整上，更多的改变体现在每一章的字里行间中，包括例子的调整和练习的补充。与众不同的精心选材和认真推敲的叙述使得第2版更趋成熟。\n这本书是C++领域的一本权威著作，书中的内容、讲授方法、选用例子和跟随练习既适合课堂教学，又适合读者自学。','[美] Bruce Eckel','机械工业出版社','7111108078','http://img4.douban.com/spic/s1085408.jpg','http://book.douban.com/subject/1101524/','search2/s_detail.jsp?sid=0199048174&sno=5','59.00元','479',0,'2002-9','1101524','平装','C++ 编程思想','8.3'),('ff8081813f1451a5013f1451d5fd0016',NULL,'','Python核心编程（第二版）','本书是Python开发者的完全指南——针对 Python 2.5全面升级\n·学习专业的Python风格、最佳实践和好的编程习惯；\n·加强对Python对象、内存模型和Python面向对象特性的深入理解；\n·构建更有效的Web、CGI、互联网、网络和其他客户端/服务器架构应用程序及软件；\n·学习如何使用Python中的Tkinter和其他工具来开发自己的GUI应用程序及软件；\n·通过用C等语言编写扩展来提升Python应用程序的性能，或者通过使用多线程增强I/0相关的应用程序的能力；\n·学习Python中有关数据库的API，以及如何在Python中使用各种不同的数据库系统，包括MySQL、Postgres和 SQLite。','[美]Wesley J. Chun（陳仲才）','人民邮电出版社','711517850X','http://img3.douban.com/spic/s3140466.jpg','http://book.douban.com/subject/3112503/','search2/s_detail.jsp?sid=01h0129760&sno=6','89.0','654',0,'2008-06','3112503','平装','Python 核心编程','7.6'),('ff8081813f1451a5013f1451d68a0017',NULL,'','Hadoop权威指南（中文版）','本书是您纵情享用数据之美的得力助手。作为处理海量数据集的理想工具，Apache Hadoop架构是MapReduce算法的一种开源应用，是Google(谷歌)开创其帝国的重要基石。本书内容丰富，展示了如何使用Hadoop构建可靠、可伸缩的分布式系统，程序员可从中探索如何分析海量数据集，管理员可以了解如何建立与运行Hadoop集群。.\n本书完全通过案例学习来展示如何用Hadoop解决特殊问题，它将帮助您：\n使用Hadoop分布式文件系统（HDFS）来存储海量数据集，通过MapReduce对这些数据集运行分布式计算..\n熟悉Hadoop的数据和I/O构件，用于压缩、数据集成、序列化和持久处理\n洞悉编写MapReduce实际应用程序时常见陷阱和高级特性\n设计、构建和管理专用的Hadoop集群或在云上运行Hadoop\n使用Pig这种高级的查询语言来处理大规模数据\n利用HBase这个Hadoop数据库来处理结构化和半结构化数据\n学习Zookeeper，这是一个用于构建分布式系统的协作原语工具箱\n如果您拥有海量数据，无论是GB级还是PB级，Hadoop都是完美的选择。本书是这方面最全面的参考。','(美) Tom White','清华大学出版社','7302224242','http://img5.douban.com/spic/s4356809.jpg','http://book.douban.com/subject/4817792/','search2/s_detail.jsp?sid=01h0187772&sno=7','79.00元','504',0,'2010.5','4817792',NULL,'Hadoop 权威指南 : 中文版','7.3'),('ff8081813f1451a5013f1451d85b0018',NULL,NULL,'Head First Python','Are you keen to add Python to your programming skills? Learn quickly and have some fun at the same time with Head First Python. This book takes you beyond typical how-to manuals with engaging images, puzzles, stories, and quizzes that are proven to stimulate learning and retention. You’ll not only learn how Python differs from other programming languages and how it’s similar, you’ll learn how to be a great programmer.\nUnderstand Python’s unique method of dynamically storing data\nBuild Python-enabled web servers and web applications\nWrite mobile apps on the Android platform\nUse PyGame and PyKyra to develop sophisticated games\nBuild GUI-based programs with Python’s handy code library\nWrite Python scripts to automate tasks on your favorite applications\nWe think your time is too valuable to waste struggling with new concepts. Using the latest research in cognitive science and learning theory to craft a multi-sensory learning experience, Head First Python uses a visually rich format designed for the way your brain works, not a text-heavy approach that puts you to sleep.','Paul Barry','O\'Reilly Media','1449382673','http://img3.douban.com/spic/s4547160.jpg','http://book.douban.com/subject/5310233/',NULL,'USD 49.99','496',1,'2010-11-30','5310233','Paperback','PYTHON','8.5'),('ff8081813f1451a5013f1451d8f60019',NULL,NULL,'JAVA 2核心技术 卷Ⅰ','本书是Java技术经典参考书，多年畅销不衰，第7版在保留以前版本风格的基础上，涵盖Java2开发平台标准版J2SE5.0的基础知识，主要内容包括面各对象程序设计、反射与代理、接口与内部类、事件监听器模型、使用Swing UI工具箱进行图形用户界面设计，异常处理、流输入/输出和对象序列化、泛型程序设计等。\n本书内容翔实、深入浅出，附有大量程序实例，极具实用价值，是Java初学者和Java程序员的必备参考书。','[美] 科奈尔','机械工业出版社','7111185234','http://img3.douban.com/spic/s1815135.jpg','http://book.douban.com/subject/1781451/',NULL,'88.00元','691',1,'2006-5','1781451','平装','JAVA','8.7'),('ff8081813f1451a5013f1451d96a001a',NULL,NULL,'Java夜未眠','本书是一本散文集。作为一名资深程序设计师，作者走笔清新面独特，简练俏皮的文字下，是作者对工作，对人生的理性思考。书中收录的文章内容贴近程序员的生活，能令读者产生强烈共鸣。此外，书中的部分文章也以轻松的风格剖析了学习Java技术时的常见问题，并以专家眼光和经验推荐介绍了一批优秀的技术书籍，旨在帮助读者兴趣盎然地学习Java。','蔡学镛','电子工业出版社','7505386603','http://img3.douban.com/spic/s1403563.jpg','http://book.douban.com/subject/1106248/',NULL,'20.00','277',1,'2003-4-1','1106248','平装(无盘)','JAVA','7.3'),('ff8081813f1451a5013f1451d9ca001b',NULL,NULL,'Java面向对象编程','《Java 面向对象编程》内容由浅入深，紧密结合实际，利用大量典型实例，详细讲解Java面向对象的编程思想、编程语法和设计模式，介绍常见Java类库的用法，总结优化Java编程的各种宝贵经验，深入阐述Java虚拟机执行Java程序的原理。书中实例均基于最新的JDK 1.5版本。全书内容包括面向对象的编程思想、Java语言的基础知识、异常处理、类与对象的生命周期、多线程、Java集合、输入/输出和GUI编程等。其最大特色是以六条主线贯穿全书：面向对象编程思想、Java语言的语法、Java虚拟机执行Java程序的原理、在实际项目中的运用、设计模式和性能优化技巧。','孙卫琴','电子工业出版社','7121025388','http://img3.douban.com/spic/s5744914.jpg','http://book.douban.com/subject/1837608/',NULL,'65.80元','625',1,'2006-7','1837608','简裝本','JAVA','7.8'),('ff8081813f1451a5013f1451da27001c',NULL,NULL,'数字图像处理','《数字图像处理(MATLAB版)》是把图像处理基础理论论述与软件实践方法相结合的第一本书，它集成了冈萨雷斯和伍兹所著的《数字图像处理》一书中的重要内容和MathWorks公司的图像处理工具箱。本书的特色在于它重点强调了怎样通过开发新代码来增强这些软件工具。本书在介绍MATLAB编程基础知识之后，讲述了图像处理的主要内容，具体包括亮度变换、线性和非线性空间滤波、频率域滤波、图像复原与配准、彩色图像处理、小波、图像数据压缩、形态学图像处理、图像分割、区域和边界表示与描述以及对象识别等。','冈萨雷斯','电子工业出版社','7121014564','http://img3.douban.com/spic/s5675977.jpg','http://book.douban.com/subject/1444801/',NULL,'50.00元','473',1,'2005-9','1444801','简裝本','MATLAB','8.5'),('ff8081813f1451a5013f1451da6f001d',NULL,NULL,'MATLAB实用教程','《MATLAB实用教程(第2版)》分三个部分介绍了MATLAB原理及其应用，共有13章。《MATLAB实用教程(第2版)》的第一部分重点介绍 MATLAB的基本原理、基本函数和图形化功能；第二部分介绍MATLAB编程方法、函数工具箱的使用方法和数据输入/输出方法；第三部分介绍方程组求解、符号数学包应用、曲线拟合以及数据可视化方法。《MATLAB实用教程(第2版)》在内容组织上深入浅出，力求通俗易懂，注重工程实用。书中提供的大量实例来自非常普通、非常基础的学科领域，内容丰富，叙述简明，同时还配有插图，给读者以轻松明快的感觉。每章结束附有习题，供练习巩固之用。\n 《MATLAB 实用教程(第2版)》的最大特点是不要求读者掌握高深的数学知识和计算机理论，就可以轻松简单地学会MATLAB原理，并能在实际工程中予以应用。因此，《MATLAB实用教程(第2版)》适用于任何工科专业的低年级大学生，既可以作为理想的教学用书，也可以作为自学参考书。   注：版权页和封面无误，封底印刷有误。','穆尔','水利电力出版社','7121101793','http://img3.douban.com/spic/s6120010.jpg','http://book.douban.com/subject/4254318/',NULL,'59.00元','470',1,'2010-1','4254318',NULL,'MATLAB','8.7'),('ff8081813f1451a5013f1451dae2001e',NULL,NULL,'MATLAB Demystified','<strong>Need to Learn MATLAB? Problem SOLVED!</strong> \n\nGet started using MATLAB right away with help from this hands-on guide. <em>MATLAB Demystified</em> offers an effective and enlightening method for learning how to get the most out this powerful computational mathematics tool.  </p>\n\nUsing an easy-to-follow format, this book explains the basics of MATLAB up front. You\'ll find out how to plot functions, solve algebraic equations, and compute integrals. You\'ll also learn how to solve differential equations, generate numerical solutions of ODEs, and work with special functions. Packed with hundreds of sample equations and explained solutions, and featuring end-of-chapter quizzes and a final exam, this book will teach you MATLAB essentials in no time at all.</p>\n\nThis self-teaching guide offers:\nThe quickest way to get up and running on MATLAB\nHundreds of worked examples with solutions\nCoverage of MATLAB 7\nA quiz at the end of each chapter to reinforce learning and pinpoint weaknesses\nA final exam at the end of the book\nA time-saving approach to performing better on homework or on the job\n\nSimple enough for a beginner, but challenging enough for an advanced user, <em>MATLAB Demystified</em> is your shortcut to computational precision. </p>','David McMahon','McGraw-Hill Professional','0071485511','http://img4.douban.com/spic/s2869668.jpg','http://book.douban.com/subject/2743356/',NULL,'USD 21.95','336',1,'2007-04-06','2743356','Paperback','MATLAB','7.7'),('ff8081813f1451a5013f1451db5d001f',NULL,NULL,'C#开发Android应用实战','《C#开发Android应用实战——使用Mono for Android和.NET/C# 全面透彻地讲解Android应用编程知识，分析如何结合使用C#和Mono来编写在Android设备系列上运行的应用程序。在这本由多位专家联袂撰写的必备精品书籍的指引下，您不必学习其他编程语言，就可以成为一名成功的Android应用程序开发人员。您将深入理解屏幕控件、UI开发、表、布局和MonoDevelop等知识点，并驾轻就熟地使用Mono for Android来规划、构建和开发Android应用程序。\n主要内容\n◆ 介绍如何使用您已经掌握的C# 和.NET技术来构建Android app\n◆ 详述使用数据以及将数据绑定到控件的最佳方法\n◆ 解释如何针对Android设备硬件编写程序\n◆ 深入分析文件系统和应用程序首选项\n◆ 讨论如何在Mono for Android、MonoTouch和WindowsPhone 7之间共享代码\n◆ 列出通过国际化和本地化支持功能来实现应用程序全球化的技巧\n◆ 介绍如何使用Android 4开发平板应用','(美) 麦克卢尔(McClure, W. B. ) 等著',NULL,'7302304998','http://img3.douban.com/spic/s26094305.jpg','http://book.douban.com/subject/20480760/',NULL,'59.80元','378',1,'2013-1','20480760',NULL,'ANDROID','0.0'),('ff8081813f1451a5013f1451dc080020',NULL,NULL,'Hadoop: The Definitive Guide','Apache Hadoop is ideal for organizations with a growing need to store and process massive application datasets. Hadoop: The Definitive Guide is a comprehensive resource for using Hadoop to build reliable, scalable, distributed systems. Programmers will find details for analyzing large datasets with Hadoop, and administrators will learn how to set up and run Hadoop clusters. The book includes case studies that illustrate how Hadoop solves specific problems.\nOrganizations large and small are adopting Apache Hadoop to deal with huge application datasets. Hadoop: The Definitive Guide provides you with the key for unlocking the wealth this data holds. Hadoop is ideal for storing and processing massive amounts of data, but until now, information on this open-source project has been lacking -- especially with regard to best practices. This comprehensive resource demonstrates how to use Hadoop to build reliable, scalable, distributed systems. Programmers will find details for analyzing large datasets with Hadoop, and administrators will learn how to set up and run Hadoop clusters.\nWith case studies that illustrate how Hadoop solves specific problems, this book helps you:\n* Learn the Hadoop Distributed File System (HDFS), including ways to use its many APIs to transfer data\n* Write distributed computations with MapReduce, Hadoop\'s most vital component\n* Become familiar with Hadoop\'s data and IO building blocks for compression, data integrity, serialization, and persistence\n* Learn the common pitfalls and advanced features for writing real-world MapReduce programs\n* Design, build, and administer a dedicated Hadoop cluster\n* Use HBase, Hadoop\'s database for structured and semi-structured data\nAnd more. Hadoop: The Definitive Guide is still in progress, but you can get started on this technology with the Rough Cuts edition, which lets you read the book online or download it in PDF format as the manuscript evolves.','Tom White','O\'Reilly Media, Inc.','0596521995','http://img3.douban.com/spic/s3810946.jpg','http://book.douban.com/subject/3220004/',NULL,'44.99','250',1,'2009','3220004','pap','HADOOP','8.4'),('ff8081813f1451a5013f1451dc740021',NULL,NULL,'Hadoop权威指南（中文版）','本书是您纵情享用数据之美的得力助手。作为处理海量数据集的理想工具，Apache Hadoop架构是MapReduce算法的一种开源应用，是Google(谷歌)开创其帝国的重要基石。本书内容丰富，展示了如何使用Hadoop构建可靠、可伸缩的分布式系统，程序员可从中探索如何分析海量数据集，管理员可以了解如何建立与运行Hadoop集群。.\n本书完全通过案例学习来展示如何用Hadoop解决特殊问题，它将帮助您：\n使用Hadoop分布式文件系统（HDFS）来存储海量数据集，通过MapReduce对这些数据集运行分布式计算..\n熟悉Hadoop的数据和I/O构件，用于压缩、数据集成、序列化和持久处理\n洞悉编写MapReduce实际应用程序时常见陷阱和高级特性\n设计、构建和管理专用的Hadoop集群或在云上运行Hadoop\n使用Pig这种高级的查询语言来处理大规模数据\n利用HBase这个Hadoop数据库来处理结构化和半结构化数据\n学习Zookeeper，这是一个用于构建分布式系统的协作原语工具箱\n如果您拥有海量数据，无论是GB级还是PB级，Hadoop都是完美的选择。本书是这方面最全面的参考。','(美) Tom White','清华大学出版社','7302224242','http://img5.douban.com/spic/s4356809.jpg','http://book.douban.com/subject/4817792/',NULL,'79.00元','504',1,'2010.5','4817792',NULL,'HADOOP','7.3'),('ff8081813f1451a5013f1451dd160022',NULL,NULL,'Hadoop技术内幕','《Hadoop技术内幕:深入解析Hadoop Common和HDFS架构设计与实现原理》内容简介：“Hadoop技术内幕”共两册，分别从源代码的角度对“Common+HDFS”和MapReduce的架构设计与实现原理进行了极为详细的分析。《Hadoop技术内幕:深入解析Hadoop Common和HDFS架构设计与实现原理》由腾讯数据平台的资深Hadoop专家、X-RIME的作者亲自执笔，对Common和HDFS的源代码进行了分析，旨在为Hadoop的优化、定制和扩展提供原理性的指导。除此之外，《Hadoop技术内幕:深入解析Hadoop Common和HDFS架构设计与实现原理》还从源代码实现中对分布式技术的精髓、分布式系统设计的优秀思想和方法，以及Java语言的编码技巧、编程规范和对设计模式的精妙运用进行了总结和分析，对提高读者的分布式技术能力和Java编程能力都非常有帮助。《Hadoop技术内幕:深入解析Hadoop Common和HDFS架构设计与实现原理》适合Hadoop的二次开发人员、应用开发工程师、运维工程师阅读。\n全书共9章，分为三部分：第一部分（第1章）主要介绍了Hadoop源代码的获取和源代码阅读环境的搭建；第二部分（第2～5章）对Hadoop公共工具Common的架构设计和实现原理进行了深入分析，包含Hadoop的配置信息处理、面向海量数据处理的序列化和压缩机制、Hadoop的远程过程调用，以及满足Hadoop上各类应用访问数据的Hadoop抽象文件系统和部分具体文件系统等内容；第三部分（第6～9章）对Hadoop的分布式文件系统HDFS的架构设计和实现原理进行了详细的分析，这部分内容采用了总分总的结构，第6章对HDFS的各个实体和实体间接口进行了分析；第7章和第8章分别详细地研究了数据节点和名字节点的实现原理，并通过第9章对客户端的解析，回顾了HDFS各节点间的配合，完整地介绍了一个大规模数据存储系统的实现。','陈湘萍','机械工业出版社','7111417666','http://img3.douban.com/spic/s26376893.jpg','http://book.douban.com/subject/24294210/',NULL,'89.00元','524',1,'2013-4','24294210','平装','HADOOP','0.0'),('ff8081813f1451a5013f1451dd770023',NULL,NULL,'C++GUI Qt4编程','《C++GUIQt4编程》(第2版)详细讲述了用最新的Qt版本进行图形用户界面应用程序开发的各个方面。前5章主要涉及Qt基础知识，后两个部分主要讲解Qt的中高级编程，包括布局管理、事件处理、二维／三维图形、拖放、项视图类、容器类、输入／输出、数据库、多线程、网络、XML、国际化、嵌入式编程等内容。对于《C++GUIQt4编程》(第2版)讲授的大量Qt4编程原理和实践，都可以轻易将其应用于Qt4．4、Qt4．5以及后续版本的Qt程序开发过程中。','Mark Summerfield','电子工业出版社','7121070383','http://img3.douban.com/spic/s5934624.jpg','http://book.douban.com/subject/3173123/',NULL,'65.00元','492',1,'2008-8','3173123',NULL,'QT','8.1'),('ff8081813f1451a5013f1451ded90024',NULL,NULL,'C++ Qt设计模式','《C++ Qt设计模式(第2版)》是美国萨福克大学已使用十余年的经典教程，利用跨平台开源软件开发框架Qt阐释了C++和设计模式中的主要思想。全书共分四个部分：第一部分介绍C++、UML、Qt、模型-视图、SQL、XML、设计模式等基础知识，目的是为零基础的C++初学者铺垫一条学习面向对象编程的快捷之路；第二部分讲解内存访问、继承等重要的C++特性，是前一部分的延伸和拓展；第三部分使用Phonon编写了一个多媒体播放器，展示了主要技术理念的应用方法；附录部分给出了C++保留关键字、Debian和Qt程序开发环境的配置等内容。每节的练习题和各章后面的复习题，既可作为课堂上的讨论题，也可进一步启发读者对于关键知识点的思考。',NULL,NULL,'7121168901','http://img3.douban.com/spic/s10205822.jpg','http://book.douban.com/subject/10764099/',NULL,'78.00元','492',1,'2012-7','10764099',NULL,'QT','0.0'),('ff8081813f1451a5013f1451e00a0025',NULL,NULL,'Linux窗口程序设计','Qt作为Linux下GUI的强大编程工具，能给用户提供精美的图形界面所需要的所有元素，已经得到了越来越广泛的应用。《Linux窗口程序设计-Qt4精彩实例分析》分11章，以循序渐进的方式对Qt应用开发进行了介绍，涵盖了界面外观、图像处理、磁盘文件、网络与通信、事件等程序设计中经常涉及的内容。作者希望通过《Linux窗口程序设计-Qt4精彩实例分析》为想学习Qt编程的读者提供入门的指导，也为从事Qt开发应用的读者提供帮助。\n《Linux窗口程序设计-Qt4精彩实例分析》内容全面，针对性强，叙述言简意赅、清晰流畅，讲解透彻，通俗易懂，图例丰富，所有实例均在Linux和Windows操作系统下进行了验证。','卢紫毅','清华大学出版社','7302181586','http://img3.douban.com/spic/s24550833.jpg','http://book.douban.com/subject/3277780/',NULL,'38.00元','316',1,'2008-11','3277780','平装','QT','7.2'),('ff8081813f1451a5013f1451e1410026',NULL,NULL,'数据结构与算法分析','《数据结构与算法分析:C语言描述(原书第2版)》内容简介：书中详细介绍了当前流行的论题和新的变化，讨论了算法设计技巧，并在研究算法的性能、效率以及对运行时间分析的基础上考查了一些高级数据结构，从历史的角度和近年的进展对数据结构的活跃领域进行了简要的概括。由于《数据结构与算法分析:C语言描述(原书第2版)》选材新颖，方法实用，题例丰富，取舍得当。《数据结构与算法分析:C语言描述(原书第2版)》的目的是培养学生良好的程序设计技巧和熟练的算法分析能力，使得他们能够开发出高效率的程序。从服务于实践又锻炼学生实际能力出发，书中提供了大部算法的C程序和伪码例程，但并不是全部。一些程序可从互联网上获得。\n《数据结构与算法分析:C语言描述(原书第2版)》是《Data Structures and Algorithm Analysis in C》一书第2版的简体中译本。原书曾被评为20世纪顶尖的30部计算机著作之一，作者Mark Allen Weiss在数据结构和算法分析方面卓有建树，他的数据结构和算法分析的著作尤其畅销，并受到广泛好评．已被世界500余所大学用作教材。 \n在《数据结构与算法分析:C语言描述(原书第2版)》中，作者更加精炼并强化了他对算法和数据结构方面创新的处理方法。通过C程序的实现，着重阐述了抽象数据类型的概念，并对算法的效率、性能和运行时间进行了分析。 \n全书特点如下： \n●专用一章来讨论算法设计技巧，包括贪婪算法、分治算法、动态规划、随机化算法以及回溯算法 \n●介绍了当前流行的论题和新的数据结构，如斐波那契堆、斜堆、二项队列、跳跃表和伸展树 \n●安排一章专门讨论摊还分析，考查书中介绍的一些高级数据结构 \n●新开辟一章讨论高级数据结构以及它们的实现，其中包括红黑树、自顶向下伸展树。treap树、k-d树、配对堆以及其他相关内容 \n●合并了堆排序平均情况分析的一些新结果 \n《数据结构与算法分析:C语言描述(原书第2版)》是国外数据结构与算法分析方面的标准教材，介绍了数据结构(大量数据的组织方法)以及算法分析(算法运行时间的估算)。《数据结构与算法分析:C语言描述(原书第2版)》的编写目标是同时讲授好的程序设计和算法分析技巧，使读者可以开发出具有最高效率的程序。 《数据结构与算法分析:C语言描述(原书第2版)》可作为高级数据结构课程或研究生一年级算法分析课程的教材，使用《数据结构与算法分析:C语言描述(原书第2版)》需具有一些中级程序设计知识，还需要离散数学的一些背景知识。\n\n海报：','Mark Allen Weiss (维斯)','机械工业出版社','711112748X','http://img3.douban.com/spic/s1106991.jpg','http://book.douban.com/subject/1139426/',NULL,'35.00元','391',1,'2004-1-1','1139426','平装','数据结构','8.9'),('ff8081813f1451a5013f1451e1bf0027',NULL,NULL,'大话数据结构','本书为超级畅销书《大话设计模式》作者程杰潜心三年推出的扛鼎之作！以一个计算机教师教学为场景，讲解数据结构和相关算法的知识。通篇以一种趣味方式来叙述，大量引用了各种各样的生活知识来类比，并充分运用图形语言来体现抽象内容，对数据结构所涉及到的一些经典算法做到逐行分析、多算法比较。与市场上的同类数据结构图书相比，本书内容趣味易读，算法讲解细致深刻，是一本非常适合自学的读物。\n本书以一个计算机教师教学为场景，讲解数据结构和相关算法的知识。通篇?一种趣味方式来叙述，大量引用了各种各样的生活知识来类比，并充分运用图形语言来体现抽象内容，对数据结构所涉及到的一些经典算法做到逐行分析、多算法比较。与市场上的同类数据结构图书相比，本书内容趣味易读，算法讲解细致深刻，是一本非常适合自学的读物。','程杰','清华大学出版社','7302255652','http://img3.douban.com/spic/s6382631.jpg','http://book.douban.com/subject/6424904/',NULL,'59.00元','440',1,'2011-6','6424904','平装','数据结构','8.0'),('ff8081813f1451a5013f1451e2490028',NULL,NULL,'STL源码剖析','学习编程的人都知道，阅读、剖析名家代码乃是提高水平的捷径。源码之前，了无秘密。大师们的缜密思维、经验结晶、技术思路、独到风格，都原原本本体现在源码之中。\n这本书所呈现的源码，使读者看到vector的实现、list的实现、heap的实现、deque的实现、Red Black tree的实现、hash table的实现、set/map的实现；看到各种算法（排序、查找、排列组合、数据移动与复制技术）的实现；甚至还能够看到底层的memory pool和高阶抽象的traits机制的实现。','侯捷','华中科技大学出版社','7560926991','http://img3.douban.com/spic/s1092076.jpg','http://book.douban.com/subject/1110934/',NULL,'68.00元','493',1,'2002-6','1110934','平装','数据结构','8.7'),('ff8081813f1451a5013f1451e2d70029',NULL,NULL,'PHP和MySQL Web开发(原书第4版)','本书将PHP开发与MySQL应用相结合，分别对PHP和MySQL做了深入浅出的分析，不仅介绍PHP和MySQL的一般概念，而且对PHP和MySQL的Web应用做了较全面的阐述，并包括几个经典且实用的例子。.\n本书是第4版，经过了全面的更新、重写和扩展，包括PHP 5.3最新改进的特性（例如，更好的错误和异常处理），MySQL的存储过程和存储引擎，Ajax技术与Web 2.0以及Web应用需要注意的安全问题。...','Laura Thomson','机械工业出版社','7111262816','http://img3.douban.com/spic/s3773304.jpg','http://book.douban.com/subject/3549421/',NULL,'95.00元','714',1,'2009','3549421','16开','PHP','8.4'),('ff8081813f1451a5013f1451e330002a',NULL,NULL,'PHP和MySQL Web开发','本书将PHP开发与MySQL应用相结合，分别对PHP和MySQL做了深入浅出的分析，不仅介绍PHP和MySQL的一般概念，而且对PHP和MySQL的Web应用做了较全面的阐述，并包括几个经典且实用的例子。','Laura Thomson','机械工业出版社','7111154703','http://img3.douban.com/spic/s1627655.jpg','http://book.douban.com/subject/1340507/',NULL,'78.00元','666',1,'2005-12','1340507','平装','PHP','8.6'),('ff8081813f1451a5013f1451e391002b',NULL,NULL,'PHP程序设计','《PHP程序设计(第2版)》是最新版本PHP 5的权威指南，其中包含创建者PHP的创建者 Rasmus Lerdorf的独到的见解。《PHP程序设计(第2版)》以一种清晰而简练的风格介绍了PHP语言的语法和程序设计技术，并通过大量的示例演示了它们的正确使用方法和习惯用法。《PHP程序设计(第2版)》还给出了设计风格提示和实际的程序设计建议，这些将帮助你不仅成为一个PHP程序员，而且将是出色的PHP程序员。','勒道夫','电子工业出版社','7121038706','http://img4.douban.com/spic/s2393468.jpg','http://book.douban.com/subject/2071057/',NULL,'68.00元','521',1,'2007-3','2071057','平装','PHP','7.7'),('ff8081813f1451a5013f1451e40e002c',NULL,NULL,'数据网络','数据网络：中文版，ISBN：9787115122926，作者：(美)Dimitri Bertsekas，(美)Robert Gallager著；卢刚，王康译','Robert Gallager','经济科学出版社,人民邮电出版社','711512292X','http://img4.douban.com/spic/s23484568.jpg','http://book.douban.com/subject/1170535/',NULL,'49.00','476',1,'2004-6-1','1170535','平装(无盘)','排队论','0.0'),('ff8081813f1451a5013f1451e460002d',NULL,NULL,'Scheduling','This new edition of the well established  text Scheduling - Theory,  Algorithms, and Systems  provides an up-to-date coverage of  important theoretical models in the scheduling literature as well as  significant scheduling problems that occur in the real world.  It  again includes  supplementary  material in the form of  slide-shows from industry and movies that show  implementations  of scheduling systems. The main structure of the book as per previous edition  consists of three  parts.  The first part focuses on deterministic  scheduling and the  related combinatorial problems.  The second part covers  probabilistic scheduling models; in this part it is assumed that processing times  and other problem data are random and not known in advance. The third part deals with scheduling in practice;  it covers heuristics that are popular with practitioners  and discusses system design and implementation issues. All three parts of this  new edition have been revamped  and streamlined.  The references have been  made completely up-to-date. Theoreticians and practitioners alike will find this book of interest. Graduate students  in operations management, operations research,  industrial engineering,  and computer science will find the book an accessible and invaluable resource. Scheduling - Theory, Algorithms,  and Systems will  serve as an essential reference for professionals  working on scheduling problems  in manufacturing,  services, and other environments. Reviews of third edition: This well-established text covers both the theory and practice of scheduling. The book begins with motivating examples and the penultimate chapter discusses some commercial scheduling systems and examples of their implementations.\" (Mathematical Reviews, 2009)','Michael L. Pinedo','Springer','1461419867','http://img3.douban.com/spic/s7049702.jpg','http://book.douban.com/subject/10161292/',NULL,'USD 84.95','693',1,'2012-1-31','10161292','Hardcover','排队论','0.0'),('ff8081813f1451a5013f1451e534002e',NULL,NULL,'An Introduction to Queueing Theory',NULL,'Baum, Dieter',NULL,'9048169135','http://img3.douban.com/spic/s7611414.jpg','http://book.douban.com/subject/10339058/',NULL,'$ 101.64','285',1,NULL,'10339058',NULL,'排队论','0.0'),('ff8081813f1451a5013f1451fcb2002f',NULL,NULL,'计算机系统结构','本教材与时俱进、自底向上的方式，依次介绍计算机系统结构的基本概念和基本内容，首先是数字逻辑短路和计算机硬件，接下来是运行于硬件之上的软件层，最后讲述通信和操作系统领域的基础知识。本书紧密联系实际，注重动手实践，利用学生感兴趣和亲生体验过的技术（如因特网、图形用户界面、移动通信等）来提高学生的学习积极性。贯穿全书，在分析系统的性能时注意将软硬件结合起来讨论，练习题充分展示出硬件和软件之间这种相互影影响、相互依赖的基本关系。\n本书适合作为高等院校计算机及相关专业计算机系统结构课程的导论性教材。','Rob williams','机械工业','711122356X','http://img5.douban.com/spic/s5772229.jpg','http://book.douban.com/subject/2307665/',NULL,'49.00元','397',2,'2008-1','2307665',NULL,'计算机系统结构','7.1'),('ff8081813f1451a5013f1451fd530030',NULL,'Effective Java programming language guide','Effective Java 中文版','本书介绍了在Java编程中57条极具实用价值的经验规则，这些经验规则涵盖了大多数开发人员每天所面临的问题的解决方案。通过对Java平台设计专家所使用的技术的全面描述，揭示了应该做什么，不应该做什么才能产生清晰、健壮的高效的代码。\n本书中的每条规则都以简短、独立的小文章形式出现，这些小文章包含了详细而精确的建议，以及对语言中许多细微之处的深入分析，并通过例子代码加以进一步说明。贯穿全书的是通用的语言用法的设计模式，以及一些具有启发意义的技巧的技术。','（美）Joshua Bloch','机械工业出版社','7111113853','http://img5.douban.com/spic/s2008079.jpg','http://book.douban.com/subject/1103015/',NULL,'39.00元','225',2,'2003-1','1103015','平装','Effective Java 中文版 ','8.8'),('ff8081813f1451a5013f1451fdea0031',NULL,NULL,'管理信息系统案例教程','《管理信息系统案例教程》以一个完整的图书馆管理系统开发案例驱动，从系统的角度引导读者掌握管理信息系统规划、分析、设计、实现与测试的全过程，较为全面地介绍管理信息系统的知识、概念、构成、技术与实现方法。《管理信息系统案例教程》共分10章，每一章均提供教学导航、任务描述、知识讲解、案例分析、本章小结、习题六大版块，以任务驱动模式组织教学，有利于学生学习和教师指导。以图书馆管理系统的开发全过程贯穿教材的各个章节，内容丰富，注重理论联系实际，使学生在案例分析中理解所学理论；同时教材遵循“教与学互动结合”的原则，提供了大量的实训题目，通过一套完整的管理信息系统开发实训，促使学生更好地掌握管理信息系统理论体系，提高学生实际分析、设计和开发能力。',NULL,NULL,'712108113X','http://img5.douban.com/spic/s5986649.jpg','http://book.douban.com/subject/3537905/',NULL,'26.00元','238',2,'2009-1','3537905',NULL,'管理信息系统案例教程','0.0'),('ff8081813f1451a5013f1455a5830032',NULL,NULL,'无线传感器网络','《无线传感器网络》介绍了无线传感器网络研究领域中的研究成果和应用技术。全书共分为三篇。第1篇是无线传感器网络的通信协议，包括网络拓扑控制、路由协议、介质访问协议和短距离低功耗无线通信标准；第2篇是无线传感器网络的支撑技术，包括定位机制、时间同步、网络安全、数据管理和数据融合；第3篇是无线传感器网络的应用技术，包括传感器节点的硬件平台、编程语言nesC、操作系统TinyOS、跟踪系统和环境监测系统。全书基本上反映了近几年来无线传感器网络相关方面的最新研究成果，并提供了详尽的参考文献。','孙利民 李建中 陈渝 朱红松','清华大学出版社','7302106932','http://img3.douban.com/spic/s5676272.jpg','http://book.douban.com/subject/1318862/',NULL,'42.00元','424',2,'2005-5','1318862','简裝本','无线传感器网络','7.9'),('ff8081813f1451a5013f1455a5d90033',NULL,'Struts in action : building Web applications with the leading Java framework','Struts 2实战','《Struts 2实战》结合实例介绍了Struts 2框架，主要内容包括Action、Result、Interceptor等框架组件，基于注解的配置选项等新特征，Struts 2插件 FreeMarker，如何从Struts 1和WebWork 2迁移到Struts 2，Ajax标签、Spring框架集成等新特性。《Struts 2实战》适合各层次Java开发人员阅读和参考。','Scott Stanli','人民邮电出版社','7115219338','http://img3.douban.com/spic/s10186025.jpg','http://book.douban.com/subject/4225168/',NULL,'59.00元','332',2,'2010-2','4225168','平装','实战 STRUTS ','7.2'),('ff8081813f1451a5013f1455a61c0034',NULL,NULL,'数据仓库与数据挖掘','\n      ','周根贵 编','\n      ','7308038319','http://img3.douban.com/spic/s6770954.jpg','http://book.douban.com/subject/1584088/',NULL,'28.00元','292',2,'2004-8','1584088',NULL,'数据仓库与数据挖掘','0.0'),('ff8081813f1451a5013f1455a6900035',NULL,NULL,'计算机算法设计与分析','《计算机算法设计与分析(第3版)》为普通高等教育“十一五”国家级规划教材，是计算机专业核心课程“算法设计与分析”教材。全书以算法设计策略为知识单元，系统介绍计算机算法的设计方法与分析技巧。主要内容包括：算法概述、递归与分治策略、动态规划、贪心算法、回溯法、分支限界法、随机化算法、线性规划与网络流、NP完全性理论与近似算法等。书中既涉及经典与实用算法及实例分析，又包括算法热点领域追踪。\n为突出教材的可读性和可用性，章首增加了学习要点提示；章末配有难易适度的习题，分为算法分析题和算法实现题两部分；配套出版了《算法设计与实验题解》；并免费提供电子课件和教学网站服务。','王晓东','电子工业','7121042789','http://img3.douban.com/spic/s23132370.jpg','http://book.douban.com/subject/2147362/',NULL,'29.50元','381',2,'2007-5','2147362',NULL,'算法设计与分析','6.0'),('ff8081813f1451a5013f1455a6fe0036',NULL,NULL,'鸟哥的Linux私房菜.基础学习篇（第三版）','本书是最具知名度的Linux入门书《鸟哥的Linux私房菜基础学习篇》的最新版，全面而详细地介绍了Linux操作系统。全书分为5个部分：第一部分着重说明Linux的起源及功能，如何规划和安装Linux主机；第二部分介绍Linux的文件系统、文件、目录与磁盘的管理；第三部分介绍文字模式接口 shell和管理系统的好帮手shell脚本，另外还介绍了文字编辑器vi和vim的使用方法；第四部分介绍了对于系统安全非常重要的Linux账号的管理，以及主机系统与程序的管理，如查看进程、任务分配和作业管理；第五部分介绍了系统管理员(root)的管理事项，如了解系统运行状况、系统服务，针对登录文件进行解析，对系统进行备份以及核心的管理等。\n本书内容丰富全面，基本概念的讲解非常细致，深入浅出。各种功能和命令的介绍，都配以大量的实例操作和详尽的解析。本书是初学者学习Linux不可多得的一本入门好书。','鸟哥','人民邮电出版社','7115226261','http://img3.douban.com/spic/s4399937.jpg','http://book.douban.com/subject/4889838/',NULL,'88.00元','778',2,'2010-6-28','4889838',NULL,'鸟哥的 LINUX 私房菜 , 基础学习篇','9.2'),('ff8081813f1451a5013f1455a7650037',NULL,NULL,'鸟哥的Linux私房菜――服务器架设篇','本书基于Linux的网络功能，分别阐述了网络的基础知识、基本的防护措施，尤其是如何架设安全的服务器等重要议题。\n　　全书共分3篇28章。第1篇“网络基础篇”介绍简易的网络基础；第2篇“简易防火措施篇”简单介绍Linux的强大网络功能、可能会发生的网络入侵问题及Linux主机的防护；第3篇“服务器架设篇”针对WWW，DNS，MAIL，FTP，DHCP，SAMBA等服务器，从最初的规划，到实际硬盘的分割、软件包的选择与安装、轲设完成之后的后续监测与维护及备份工作等，都一一给出了详实的分析与讲解。\n　　本书适合已经具有Linux操作系统相关知识的网络管理人员，可作为Linux服务器管理员的参考用书','鸟哥','科学出版社','7030155882','http://img3.douban.com/spic/s5743190.jpg','http://book.douban.com/subject/1398620/',NULL,'73.00元','667',2,'2005-6','1398620','简裝本','鸟哥的 LINUX 私房菜 , 服务器架设篇','8.6'),('ff8081813f1451a5013f1455a80d0038',NULL,NULL,'Java 程序设计',NULL,NULL,NULL,'7040372878','http://img3.douban.com/pics/book-default-small.gif','http://book.douban.com/subject/24719190/',NULL,NULL,NULL,2,NULL,'24719190',NULL,'Java 程序设计','0.0'),('ff8081813f1451a5013f1455a8a50039',NULL,'National computer rand examination , 三级数据库技术','全国计算机等级考试','《全国计算机等级考试 习题集》是根据全国计算机等级考试(一级B)的考试大纲要求编写的，共30套习题，主要内容包括：理论全真试题和上机全真试题指导。每一套习题都附有参考答案，以供读者自我检测。\n    本习题集体现了全国计算机等级考试(一级B)考试大纲的要求，将理论和实践结合，使用全真题练习，由浅入深，层次分明，重点突出。《全国计算机等级考试 习题集》可作为全国计算机等级考试(一级B)的习题训练教材，同时也可作为其他人员学习计算机基础知识及应用的参考练习。本套习题集由滕春燕统稿。','滕春燕',NULL,'7115287872','http://img3.douban.com/spic/s24502346.jpg','http://book.douban.com/subject/11633472/',NULL,'24.00元','162',2,'2012-9','11633472',NULL,'全国计算机等级考试 ','0.0'),('ff8081813f1451a5013f1455a909003a',NULL,NULL,'数字卫星通信','全书一数字卫星通信为主，内容包括：概论、卫星通信的调制技术、多址技术、编码技术、信号处理技术、卫星通信网、卫星通信线路的计算与系统举例以及卫星电视广播等。特别是书中结合近年来国际上及我国在卫星通信方面的现状与新技术的发展，介绍了新的调制方式、编码方式、VSAT卫星通信网、低轨道移动卫星通信系统、先进技术卫星以及卫星直播电视等。','储钟圻','机械工业出版社','7111177274','http://img4.douban.com/spic/s1551128.jpg','http://book.douban.com/subject/1446670/',NULL,'46.00元','466',2,'2006-1','1446670','平装','数字卫星通信','0.0'),('ff8081813f1451a5013f1455a964003b',NULL,NULL,'Linux 操作系统原理与应用','《Linux 操作系统原理与应用(第2版)》是Linux内核及动手实践的入门教程。在庞大的Linux内核中，选取最基本的内容——进程管理、中断、内存管理、系统调用、内核同步、文件系统、I/O设备管理等进行阐述。从原理出发，基于Linux内核源代码但又不局限于代码，分析原理如何落实到代码，并通过简单有效的实例说明如何调用Linux内核提供的函数进行内核级程序的开发。主要章节给出了具有实用价值的小型应用，从而让读者在实践中加深对原理的理解和应用能力。\n《Linux 操作系统原理与应用(第2版)》对于希望深入Linux操作系统内部、阅读Linux内核源代码以及进行内核级程序开发的读者具有较高的参考价值。《Linux 操作系统原理与应用(第2版)》可作为高等院校计算机相关专业的本科生、研究生的教材，Linux应用开发人员、嵌入式系统开发人员等均可从《Linux 操作系统原理与应用(第2版)》中获益。',NULL,NULL,'7302278369','http://img3.douban.com/spic/s8949643.jpg','http://book.douban.com/subject/10523716/',NULL,'28.00元','255',2,'2012-1','10523716',NULL,'Linux 操作系统原理与应用','0.0'),('ff8081813f1451a5013f1455a9e3003c',NULL,NULL,'JavaScript编程宝典','《JavaScript编程宝典(第2版)》详细完整地介绍了JavaScript语言，内容涉及从基础语法到高级技术的方面面面，并通过实例说明如何将这些技术应用到实际开发中。全书共25章，内容包括JavaScript基础语法、支持闭包的函数、基于原型的面向对象、JavaScript内建对象及应用、正则表达式原理及应用、BOM与DOM、事件模型、各种DOM对象及DOM API的应用、通过DOM与文档的交互、动态样式和文档、Image／Canvas／SVG图形图像处理、Cookie与隐藏框架、Ajax原理及应用、错误处理等。\n《JavaScript编程宝典(第2版)》具有极强的实用性，书中设计了150多个完整的实例以及许多代码片段来说明如何应用JavaScript，网站中需要的各种JavaScript应用几乎都能在这里找到。这些实例包括显示当前日期与时间、图像时钟、自动跳转、动态修改元素内容、动态修改文档结构、表单验证、可控制的滚动公告栏、树形目录、多级树形目录、下拉菜单、跟随鼠标的图片、沿指定路径运动的图片、围绕鼠标旋转的字符串、位于窗口固定位置的广告、飘落的雪花、隐藏的浮动导航面板、滚动的图片串、正则表达式进行验证等常见的应用，以及图像缓存、Canvas绘图、列表排序、表格的客户端排序、表单数据绑定、表格数据绑定、Cookie应用、使用隐藏框架与服务器端通信、Ajax应用、XML处理、调用JavaApplet、控制Flash、MP3循环播放列表等高级应用。这些实例均可以直接复制使用，程序中均有详细的注释说明，可以根据需要进行修改。\n《JavaScript编程宝典(第2版)》适合JavaScript初学者以及各层次的Web应用开发人员。','陈争航','电子工业出版社','7121071509','http://img3.douban.com/spic/s5946192.jpg','http://book.douban.com/subject/3247023/',NULL,'99.00元','805',2,'2008-10','3247023',NULL,'JavaScript 编程宝典','0.0'),('ff8081813f1451a5013f145ff1d1003e',NULL,NULL,'诸葛孔明','《诸葛孔明》内容简介：陈舜臣之历史传记小说《诸葛孔明》是历史传记中一部难得一见的好作品。在中国，诸葛亮不仅仅是一个历史人物，他承载了无数传说，是一个极具文化和思想的象征符号。而日本著名历史小说家陈舜臣又会在他的《诸葛孔明》中给我们奉献一个怎样独特的孔明呢？\n在《诸葛孔明》中，陈舜臣细细勾勒孔明的一生，从而带出整个波澜壮阔的三国英雄群像，这些早已口耳相传的三国人物和他们的故事在陈舜臣的笔下，显示出与传说有所不同的独特风格。陈舜臣以诸葛孔明的一生为经，以他所处的环境为纬，将斑斓的三国历史碎片织成一张网，那些孤立的历史故事在这张网里各安其位，从而达到一个浑然的整体。伴随诸葛亮的人生历程，一个或许更加符合历史逻辑的真实三国穿越重重帷幔，走向了历史台前。\n诸葛亮之修身齐家治国平天下，是故事发展的一条线索，也是三国历史的进程。伴随这条进程，除了孔明，无数三国英雄人物纷纷粉墨登场，演绎出一个个或许更加真实而合理的三国故事。刘备的复杂人格特质，曹操不逊于孔明的情报搜集手段，刘表软弱的仁义表象，孙权在幕前演戏时体现出的权谋……甚至不经意间寥寥几笔勾画的莽张飞，等等。——在汉末波诡云谲的乱世风云中，无数我们熟悉的三国英雄拨开历史烟尘，穿越刀光剑影，纷纷从纸墨深处绽放出他们鲜活而又真诚的面容。这些著名的风云人物和那些在历史演义中不是很耀眼的人物——比如诸葛亮的叔叔诸葛玄、姐姐诸葛铃、弟弟诸葛均、继母宋氏、妻子绶，甚至于虚构的管家甘海等人一起，围绕在真切而平实的诸葛孔明周围，在那个传奇的时代，展开了一段段作为生命个体而存在的独特的孔明故事，从而构筑出一个陈舜臣笔下的另类三国天下。','陈舜臣','福建人民出版社','7211061197','http://img3.douban.com/spic/s6147501.jpg','http://book.douban.com/subject/4264699/',NULL,'35.00元','404',2,'1970-1','4264699','平装','诸葛孔明','7.5'),('ff8081813f1451a5013f145ff294003f',NULL,NULL,'嵌入式实时操作系统VxWorks及其开发环境Tornado','\n      ','柏桂枝','中国电力出版社','7508308069','http://img3.douban.com/spic/s2628757.jpg','http://book.douban.com/subject/1231653/',NULL,'32.00','352',2,'2002-1','1231653','平装(无盘)','嵌入式实时操作系统 VxWorks 及其开发环境 Tornado','0.0'),('ff8081813f1451a5013f145ff39c0040',NULL,NULL,'Linux Shell实例精解','开源软件丛书。 本书重点讲述了当下最流行的两个Linux Shell——Borne Again Shell (bash)和TC Shell(tcsh)，从它们的新特性、增加和内建的插件讲起直至具体的应用。通过对一个个实例的讲解，循序渐进地介绍了Linux Shell中的各个知识点，使读者逐步具备读写Shell程序的能力。 本书适合初、中级专业技术人员，以及对本技术感兴趣的读者阅读。','Ellie Quigley','中国电力出版社','7508313062','http://img3.douban.com/spic/s2549262.jpg','http://book.douban.com/subject/1236863/',NULL,'59.00','544',2,'2003-02-01