IX初级教程','UNIX初级教程（第4版），ISBN：9787505387089，作者：（美）Amir Afzal著；李石君等译；李石君译','阿夫扎尔','电子工业出版社','7505387081','http://img3.douban.com/spic/s9870587.jpg','http://book.douban.com/subject/1237832/',NULL,'35.00元','350',2,'2004-1','1237832','简裝本','UNIX 初级教程 ','0.0'),('ff8081813f1451a5013f145ff9b60047',NULL,'The pragmatic programmer : 从小工到专家','程序员修炼之道','《程序员修炼之道》由一系列的独立的部分组成，涵盖的主题从个人责任、职业发展，直到用于使代码保持灵活、并且易于改编和复用的各种架构技术。利用许多富有娱乐性的奇闻轶事、有思想性的例子以及有趣的类比，全面阐释了软件开发的许多不同方面的最佳实践和重大陷阱。无论你是初学者，是有经验的程序员，还是软件项目经理，本书都适合你阅读。','David Thomas','电子工业出版社','7505397192','http://img3.douban.com/spic/s3957204.jpg','http://book.douban.com/subject/1152111/',NULL,'48.00元','333',2,'2005-1','1152111','平装','程序员修炼之道 ','8.7'),('ff8081813f1451a5013f145ffa740048',NULL,NULL,'如何成功管理一个软件项目','本书提供了详细的指导和交付成功的IT项目的必要工具，这其中的工具包括已被证明可行的技术、指导及清单。这种逐步深入的学习将指导使用者如何使用Microsoft Project 2000实现这些技术。  \n通过本书的学习，将能够完成满足用户需要的软件开发。其中，将会发现一个可供继续填充的框架，它可以引导管理者在项目中实现最佳的可行结果。这个框架提供了所有的方法、工具及实现手段以供在项目中使用。本书中也介绍了迭代项目开发方法学（IPDM），它包括n层结构、继承应用及电子商务解决方案。','陈明','中国铁道出版社','7113052630','http://img3.douban.com/spic/s9842552.jpg','http://book.douban.com/subject/1137122/',NULL,'37.00元','301',2,'2003-10','1137122','简裝本','如何成功管理一个软件项目','0.0'),('ff8081813f1451a5013f145ffb9b0049',NULL,'Internetworking with TCP/IP . 卷3Vol Ⅲ , 客户-服务器编程与应用(Windows套接字版)client-server programming and applications windows sockets version','TCP/IP 与网络互联技术',NULL,NULL,NULL,'7118018430','http://img3.douban.com/spic/s25757112.jpg','http://book.douban.com/subject/5448554/',NULL,'27.00元','292',2,'1998-5','5448554',NULL,'TCP/IP 网络互联技术 ','0.0'),('ff8081813f1451a5013f145ffc6b004a',NULL,NULL,'Tornado用户指南/VxWorks开发人员指南丛书',NULL,'[美] Win','清华大学','7302085935','http://img4.douban.com/spic/s9933928.jpg','http://book.douban.com/subject/1199162/',NULL,'36.00元','382',2,'2004-1','1199162',NULL,'Tornado 用户指南','0.0'),('ff8081813f1451a5013f145ffedf004b',NULL,NULL,'Java Swing','Swing is a fully-featured user interface development kit for Java applications. Building on the foundations of the Abstract Window Toolkit (AWT), Swing enables cross-platform applications to use any of several pluggable look-and-feels. Swing developers can take advantage of its rich, flexible features and modular components, building elegant user interfaces with very little code. This second edition of Java Swing thoroughly covers all the features available in Java 2 SDK 1.3 and 1.4. More than simply a reference, this new edition takes a practical approach. It is a book by developers for developers, with hundreds of useful examples, from beginning level to advanced, covering every component available in Swing. All these features mean that there\'s a lot to learn. Even setting aside its platform flexibility, Swing compares favourably with any widely available user interface toolkit - it has great depth. Swing makes it easy to do simple things but is powerful enough to create complex, intricate interfaces. This 2nd edition includes: a new chapter on Drag and Drop; accessibility features for creating a user interface meeting the needs of all users; coverage of the improved key binding infrastructure introduced in SDK 1.3; a new chapter on JFormattedTextField and input validation; Mac OS X coverage and examples; coverage of the improved focus system introduced in SDK 1.4; pluggable Look-and-Feel coverage; coverage of the new layout manager, SpringLayout, from SDK 1.4; properties tables that summarize important features of each component; coverage of the 1.4 Spinner component; details about using HTML in components; a new appendix listing bound actions for each component; and a supporting web site with utilities, examples, and supplemental materials.','Brian Cole','O\'Reilly Media','0596004087','http://img3.douban.com/spic/s4263364.jpg','http://book.douban.com/subject/1780223/',NULL,'USD 59.99','1260',2,'2002-11-01','1780223','Paperback','Java Swing','0.0'),('ff8081813f1451a5013f145fffdc004c',NULL,NULL,'JSP基础教程','《JSP基础教程：黑魔方》详细讲解了JSP语法和基本的程序设计方法。全书共分6章，内容包括JSP简介、JSP语法、JSP内置对象、JSP文件操作，以及如何在JSP中使用数据库等重要内容。《JSP基础教程：黑魔方》所有知识都结合具体实例进行介绍，力求详略得当，突出JSP在开发Web动态网站方面的强大功能及在开发商务网站方面的应用，使读者快速掌握和运用JSP的编程技巧。JSP（Java Server Pages）是一种动态网页技术标准，它可以无缝地运行在Unix、Linux和 Windows 操作平台上，利用这一技术可以建立安全、跨平台的先进动态网站。','耿祥义','清华大学出版社','7302096066','http://img3.douban.com/spic/s1491302.jpg','http://book.douban.com/subject/1239558/',NULL,'22.00元','260',2,'2004-1','1239558','简裝本','JSP 基础教程','0.0'),('ff8081813f1451a5013f146000c2004d',NULL,NULL,'数学建模案例精编','本书是编者在多年从事数学建模教学、研究的基础上，精选部分全国大学生数学建模竞赛获奖论文以及建模培训使用的优秀论文汇编而成。全书包括18个经典案例，各案例独立成篇，结构严谨，内容完整，均给出了详尽的分析。\n   本书具有案例丰富、分析透彻、内容覆画面广、实用性较强等特点，既可作为高等院校相关专业的数学建模案例教材和参考书，也可作为各类科技、工程工作者的参考用书，还可作为参加国内外数学建模竞赛的指导用书。','吴建国','中国水利水电出版社','7508428145','http://img3.douban.com/spic/s6451244.jpg','http://book.douban.com/subject/1320704/',NULL,'45.00元','455',2,'2005-5','1320704',NULL,'数学建模案例精编','0.0'),('ff8081813f1451a5013f146001a1004e',NULL,NULL,'用例驱动的UML对象建模应用',NULL,'袁国忠','人民邮电出版社','7115133956','http://img3.douban.com/spic/s1527150.jpg','http://book.douban.com/subject/1319739/',NULL,'28.0','168',2,'2005-5-1','1319739','平装(无盘)','用例驱动的 UML 对象建模应用 : 范例分析','0.0'),('ff8081813f1451a5013f1460037b004f',NULL,'Operating systems','操作系统设计与实现（上册）','本书是关于操作系统的权威教材。大多数关于操作系统的图书均重理论而轻实践，而本书则在这两者之间进行了较好的折中。本册详细探讨了操作系统的基本原理，包括进程、进程间通信、信号量、管程、消息传递、调度算法、输入、输出、死锁、设备驱动程序、存储管理、调页算法、文件系统设计、安全和保护机制等；此外，还详细讨论了一个特殊的操作系统MINIX 3（一个与UNIX兼容的操作系统），并提供了该系统的源代码（见本书下册），以便于读者仔细研究。这种安排不仅可让读者了解操作系统的基本原理，而且可让读者了解到这些基本原理是如何应用到真实的操作系统中去的。\n本书适用于高校计算机专业的学生，也可供程序设计人员、工程技术人员、系统架构师等相关人员参考。','Albert S. Woodhull','电子工业出版社','712103381X','http://img4.douban.com/spic/s5811568.jpg','http://book.douban.com/subject/2044818/',NULL,'49.80元','453',2,'2007-3','2044818','平装','操作系统 ','9.0'),('ff8081813f1451a5013f1460044b0050',NULL,NULL,'JAVA多线程设计模式','《JAVA多线程设计模式》中包含JAVA线程的介绍导读，12个重要的线程设计模式和全书总结以及丰富的附录内容。每一章相关线程设计模式的介绍，都举一反三使读者学习更有效率。最后附上练习问题，让读者可以温故而知新，能快速地吸收书中的精华，书中最后附上练习问题解答，方便读者学习验证。','博硕文化','中国铁道出版社','7113064027','http://img3.douban.com/spic/s1406772.jpg','http://book.douban.com/subject/1281934/',NULL,'49.00元','493',2,'2005-4-1','1281934','平装(无盘)','Java 多线程设计模式','8.4'),('ff8081813f1451a5013f146005440051',NULL,NULL,'设计模式','设计模式：Java语言中的应用，ISBN：9787113064563，作者：结城 洁 著，博硕文化 译；博硕文化译','博硕文化','中国铁道出版社','7113064566','http://img3.douban.com/spic/s1638500.jpg','http://book.douban.com/subject/1323556/',NULL,'48.00元','456',2,'2005-6-1','1323556','平装(无盘)','设计模式 : Java语言中的应用','8.0'),('ff8081813f1451a5013f1460064d0052',NULL,'Fast access to news listening','新闻听力速成','根据新闻听力中最常出现的内容，本书分成导论、正文、附录等部分。本书的导论部分概括介绍了新闻听解中的重要技巧，如果听者在听解后面的每个章节的内容时，都能灵活运用这些技巧，不断实践应用这些技能，就一定可以大大提高听解能力。本书正文分为经济、政治、外交、军事、教育、娱乐、体育、生活等不同章节。各个章节的每篇文章后面均附有注释。\n    由于多数英语学习者只是习惯于英音或者美音中的一种发音方式，为了克服听者只熟悉美音或只能听懂英音的局限，本书的光盘配音兼顾英音和美音，使听者在平日的练习就熟悉两种发音方式，减少应试听解听障碍。\n    本书可作为具有中等以上英语水平的各种英语学习者的日常提高能力的工具书，也可以作为考试前应试能力检测的手段。','刘春伟','机械工业出版社','7111175999','http://img3.douban.com/spic/s5737273.jpg','http://book.douban.com/subject/1445960/',NULL,'22.80元','234',2,'2006-1','1445960','平装','新闻听力速成 ','0.0'),('ff8081813f1451a5013f146006ff0053',NULL,NULL,'HTML完全使用详解','本书根据网页制作的实际特点和目前市场需要，全面系统地介绍了最新的HTML4.01。丰富的实例贯穿全书，能帮助您全面掌握HTML，而且本书所有实例均可直接修改使用，可以提高您的工作效率。此外，本书还特别设计了索引，是实用的HTML语言手册。','黄斯伟','人民邮电出版社','711514124X','http://img3.douban.com/spic/s9999852.jpg','http://book.douban.com/subject/1446753/',NULL,'36.0','387',2,'2006-1','1446753','平装','HTML 完全使用详解','0.0'),('ff8081813f1451a5013f1460084f0054',NULL,NULL,'Java语言程序设计基础篇','《Java语言程序设计基础篇》(原书第5版本书是Java语言的经典教材，畅销多年不衰。本书以J2SE 5.0版本为基础，采用“先讲基础”的教学方式，循序渐进地介绍了程序设计基础、面向对象的程序设计、图形用户界面设计、异常处理和输入/输出等。另外，本书还全面且深入地覆盖了一些高级主题，包括GUI应用程序、applet、数据结构、多线程、JavaBeans、高级GUI、数据库、JSP、分布式计算等。','梁','机械工业出版社','7111190599','http://img3.douban.com/spic/s10354987.jpg','http://book.douban.com/subject/1882459/',NULL,'58.00元','500',2,'2006-8','1882459','平装','Java 2 程序设计基础','8.0'),('ff8081813f1451a5013f146009000055',NULL,NULL,'UML与软件建模','《UML与软件建模》在全面介绍UML中的视图、模型元素、图以及公共机制等基本知识的基础上，着重介绍基于UML的软件体系结构建模方法、基于UML的实时系统建模方法（同时分析比较Rational Rose和Rose-RT这两个建模工具实时建模的优缺点）、基于UML的单元测试、集成测试和系统测试方法以及UML模型到关系数据库和C++语言映射的实现细节，并通过一个数码声音录音机的面向对象设计和实现过程来说明如何应用UML进行实际的建模。\n《UML与软件建模》共分3篇：第1篇（第1～7章）为语言篇，着重介绍UML语言本身，包括UML 的结构和基本元素；第2篇（第8～12章）为建模篇，着重讨论UML在体系结构建模、实时系统的建模和软件测试上的应用，同时介绍从UML模型到关系数据库和C++语言的映射等实现细节；第3篇（第13章）为应用篇，基于UML的软件建模实例，介绍UML在建模上的应用。《UML与软件建模》提供了大量应用实例，每章后均附有习题。\n《UML与软件建模》不仅适用于高等院校计算机、软件工程专业高年级本科生、研究生作为教材使用，也适用于对UML比较熟悉并且对软件建模有所了解的开发人员、广大科技工作者和研究人员作为参考书。','徐宝文','清华大学出版社','7302118469','http://img3.douban.com/spic/s1944270.jpg','http://book.douban.com/subject/1728759/',NULL,'29.00元','358',2,'2006-1','1728759','简裝本','UML 与软件建模','0.0'),('ff8081813f1451a5013f146009e70056',NULL,'Introduction to data mining','数据挖掘导论','本书全面介绍了数据挖掘的理论和方法，旨在为读者提供将数据挖掘应用于实际问题所必需的知识。本书涵盖五个主题：数据、分类、关联分析、聚类和异常检测。除异常检测外，每个主题都包含两章：前面一章讲述基本概念、代表性算法和评估技术，后面一章较深入地讨论高级概念和算法。目的是使读者在透彻地理解数据挖掘基础的同时，还能了解更多重要的高级主题。此外，书中还提供了大量示例、图表和习题。\n    本书适合作为相关专业高年级本科生和研究生数据挖掘课程的教材，同时也可作为数据挖掘研究和应用开发人员的参考书。','Pang-Ning Tan, Michael Steinbach','人民邮电出版社','7115146985','http://img3.douban.com/spic/s10037981.jpg','http://book.douban.com/subject/1786120/',NULL,'49.00元','422',2,'2006-5','1786120','简裝本','数据挖掘导论 ','8.5'),('ff8081813f1451a5013f14600af40057',NULL,'Operation support system','电信运营支撑系统','《电信运营支撑系统》(第2版)内容丰富，题材新颖，全面反映了运营支撑系统各个领域的内容，适合大学高年级学生和研究生、电信运营企业的技术人员、电信软件企业的技术人员以及科研单位的研究人员参考使用。','陈龙','人民邮电出版社','7115162549','http://img3.douban.com/spic/s10152680.jpg','http://book.douban.com/subject/2177418/',NULL,'49.0','360',2,'2007-8','2177418','平装','电信运营支撑系统 ','0.0'),('ff8081813f1451a5013f14600bfb0058',NULL,'Professional Java development with the Spring framework','Spring框架高级编程','Spring框架是主要的开源应用程序开发框架，它使得Java／J2EE开发更容易、效率更高。本书不仅向读者展示了Spring能做什么?而且揭示了Spring完成这些功能的原理，解释其功能和动机，以帮助读者使用该框架的所有部分来开发成功的应用程序。本书涵盖Spring的所有特性，并且演示了如何将其构成一个连贯的整体，帮助读者理解Spring方法的基本原理、何时使用Sping以及如何效仿最佳实践。所有这些都以完整的样本应用程序来举例说明。读完本书，读者将能够有效地在各种应用中(从简单的web应用程序到复杂的企业级应用程序)使用Spring。\n　　本书旨在指导读者何使用Spring框架来实现各种有效应用程序的开发(从简单的Web应用到复杂的企业级应用)。通过一个完整的样本应用程序贯穿全书，举例说明Spring如何提供一个清晰的、分层的体系结构的基础；以及如何适当地使用Spring来实现好的OO设计和体系结构设计，以及如何应用最佳实践。\n　　本书面向欲深人学习Spring框架的Java／J2EE体系结构设计人员和开发人员，使他们能够把spring框架有效地用于从简单的Web应用到复杂的企业级应用；也非常适合Spring框架新手作为常备参考书。','约翰逊','机械工业出版社','7111186389','http://img3.douban.com/spic/s8990957.jpg','http://book.douban.com/subject/1819569/',NULL,'59.00元','471',2,'2006-4','1819569','简裝本','Spring 框架高级编程 ','7.1'),('ff8081813f1451a5013f14600e070059',NULL,NULL,'征服Ajax Web 2.0快速入门与项目实践',NULL,'张桂元','人民邮电','7115148031','http://img3.douban.com/spic/s10040562.jpg','http://book.douban.com/subject/1835397/',NULL,'36.00元','300',2,'2006-6','1835397',NULL,'征服 Ajax , Web 2.0快速入门与项目实践(Java)','6.6'),('ff8081813f1451a5013f14600ec5005a',NULL,NULL,'Hibernate项目开发宝典','本书以Hibernate为核心，详细讲解了基于组件的J2EE应用软件的开发方法。在讲解方式上，使用基础知识与具体实例相结合的方式对Hibernate进行了全面、深入、细致的讲解，使读者在学习的过程中可以通过具体的练习来加深对讲解内容的理解和把握。\n　　本书在讲解Hibernate的同时，还介绍了经常与Hibernate配合使用的Struts，JSF以及Spring等优秀的框架组件。另外，还涉及到了在开发中常会使用到的开源组件，包括Ant，Digester，XDoclet，Log4j，Eclipse和JFreechart等。 \n　　本书的配套光盘中包含了书中所有实例的完整源代码以及在开发中需要用到的开源组件的安装程序。另外，作者提供了交流空间为广大读者进行后续的支持。\n　　本书适用于使用Hibernate进行Web应用程序开发的技术人员，同时也非常适合对Hibernate相关技术感兴趣的读者进行学习和提高。\n\n　　本书的第1部分介绍丁关于持久层的基础知识以及Hbernate的基本知识，然后介绍了软件环境的配置方法。接着，通过一个具体的实例讲解了如何使用Hibernate进行留言板系统的开发。最后，在前面实例的基础上对Hibernate的框架结构以及Hbernate的主要类进行了全面的讲解。在这一部分中还进行了Hibern8te辅助工具的配置和使用方法的介绍。\n　　本书的第2部分包括了两个实例。第一个实例介绍了如何使用JSP和Hibernate完成在线投票系统的开发。在这个项目中，通过JFreechart组件实现了统计结果的图形化显示。第二个实例详细介绍了如何使用Struts和Hibernate来完成在线考试系统的开发。在这个实例中还对Struts的一些必要的基础知识以及集成方法进行了介绍。\n　　第3部分的Hibernate的集成开发部分也包括两个实例。分别是用JSF，Spring和Hibetrnate完成的商品管理系统以及使用Struts，Spring和Hibernate完成的在线订货系统。这一部分重点讲解的是现在软件开发的方法以及如何实现Hibernate与不同的框架结构之间的集成与配合。','陈天河','电子工业','7121026341','http://img3.douban.com/spic/s6627114.jpg','http://book.douban.com/subject/1831676/',NULL,'79.00元','726',2,'2006-6','1831676',NULL,'Hibernate 项目开发宝典','0.0'),('ff8081813f1451a5013f14600fd1005b',NULL,NULL,'Spring技术手册',NULL,'林信良','电子工业出版社博文视点','7121027208','http://img3.douban.com/spic/s1732073.jpg','http://book.douban.com/subject/1830509/',NULL,'48.00元','386',2,'2006-07','1830509',NULL,'Spring 技术手册','7.8');
